strings/concat.html.body:
Concatenation
संयोजन
Concatenation involves adding two or more strings together, creating a larger string containing the combined data of those original strings.  The concatenation of a string appends one or more strings to another string.  This is done in JavaScript using the following ways.
संयोजनमा दुई वा दुई भन्दा बढी स्ट्रिङहरू एकसाथ थप्नु समावेश छ, ती मूल स्ट्रिङहरूको संयुक्त डेटा समावेश गर्ने ठूलो स्ट्रिङ सिर्जना गर्दछ।  स्ट्रिङको संयोजनले एक वा एकभन्दा बढी स्ट्रिङलाई अर्को स्ट्रिङमा जोड्दछ।  यो जाभास्क्रिप्टमा निम्न तरिकाहरू प्रयोग गरेर गरिन्छ।

using the  + operator
'+' अपरेटर प्रयोग गर्दै
using the concat() method
concat() विधि प्रयोग गर्दै
using the array join() method
सरणी join() विधि प्रयोग गर्दै
using the template literal (introduced in ES6)
टेम्प्लेट शाब्दिक प्रयोग गर्दै (ईएस 6 मा प्रस्तुत)

The string concat() method accepts the list of strings as parameters and returns a new string after concatenation i.e. combination of all the strings. Whereas the array join() method is used to concatenate all the elements present in an array by converting them into a single string.
स्ट्रिङ concat() विधिले स्ट्रिङको सूचीलाई प्यारामिटरको रूपमा स्वीकार गर्दछ र संयोजन पछि नयाँ स्ट्रिङ फर्काउँछ अर्थात् सबै स्ट्रिङहरूको संयोजन। जबकि एरे join() विधि एरेमा उपस्थित सबै तत्वहरूलाई एकल स्ट्रिङमा रूपान्तरण गरेर संयोजन गर्न प्रयोग गरिन्छ।
The template literal  uses backtick (``) and provides an easy way to create multiline strings and perform string interpolation. An expression can be used inside the backtick using $ sign and curly braces $(expression}.
टेम्प्लेट शाब्दिक रूपमा ब्याकटिक (``) प्रयोग गर्दछ र मल्टिलाइन स्ट्रिङहरू सिर्जना गर्न र स्ट्रिङ इन्टरपोलेसन प्रदर्शन गर्न सजिलो तरिका प्रदान गर्दछ।$चिन्ह र घुंघराले ब्रेसेस$(अभिव्यक्ति} प्रयोग गरेर ब्याकटिक भित्र अभिव्यक्ति प्रयोग गर्न सकिन्छ।
const icon = '👋';
// using template Strings
`hi ${icon}`;

// using join() Method
['hi', icon].join(' ');

// using concat() Method
''.concat('hi ', icon);

//  using + operator
'hi ' + icon;
// hi 👋

arrays/push.html.body:
Push
पुश
One can push certain items to an array making the last index the newly added item. It changes the length of an array and returns a new length.
अन्तिम अनुक्रमणिकालाई नयाँ थपिएको वस्तु बनाउने सरणीमा निश्चित वस्तुहरू धकेल्न सकिन्छ। यसले एरेको लम्बाइ परिवर्तन गर्दछ र नयाँ लम्बाइ फर्काउँछ।
Here's the syntax for using push:
यहाँ 'पुश' प्रयोग गर्नका लागि वाक्यरचना छ:
array.push(element1[, ...[, elementN]]);

The element1, ..., elementN arguments represent the elements to be added to the end of the array.
element1, ..., elementN तर्कहरूले एरेको अन्त्यमा थपिने तत्वहरूको प्रतिनिधित्व गर्दछ।
For example:
उदाहरण को लागी:
let array = [1, 2, 3]; 
array.push(4); 

console.log(array); 

// Result: array = [1, 2, 3, 4]

You can also use push to add elements to the end of an array-like object (such as an arguments object or a NodeList object) by first converting it to an array using the Array.prototype.slice() method:
तपाईँले एरे जस्तो वस्तु (जस्तै तर्क वस्तु वा नोडलिस्ट वस्तु) को अन्त्यमा तत्वहरू थप्न push पनि प्रयोग गर्न सक्नुहुन्छ, यसलाई Array.prototype.slice() विधि प्रयोग गरेर सरणीमा रूपान्तरण गरेर:
function printArguments() {
  let args = Array.prototype.slice.call(arguments);
  args.push('d', 'e', 'f');
  console.log(args);
}

printArguments('a', 'b', 'c'); // Result: ["a", "b", "c", "d", "e", "f"]

  Note that the push method modifies the original array. It does not create a new array.
नोट गर्नुहोस् कि पुश विधि विधिले मूल एर्रे परिमार्जन गर्दछ। यसले नयाँ एरे सिर्जना गर्दैन।

arrays/indices.html.body:
Indices
सूचकांक
So you have your array of data elements, but what if you want to access a specific element? That is where indices come in. An index refers to a spot in the array. indices logically progress one by one, but it should be noted that the first index in an array is 0, as it is in most languages. Brackets [] are used to signify you are referring to an index of an array.
तपाइँसँग डेटा तत्वहरूको तपाईंको एरे छ, तर यदि तपाईं एक विशिष्ट तत्व पहुँच गर्न चाहनुहुन्छ भने के हुन्छ? यहीँबाट इन्डेक्स आउँछ । एक अनुक्रमणिका ले सरणीमा एक स्थानलाई बुझाउँछ। सूचकांकहरू तार्किक रूपमा एक-एक गरेर प्रगति गर्छन्, तर यो ध्यान दिनुपर्दछ कि एरेमा पहिलो अनुक्रमणिका ० हो, किनकि यो अधिकांश भाषाहरूमा छ। तपाईँले सरणीको अनुक्रमणिकालाई सङ्केत गर्दै हुनुहुन्छ भन्ने सङ्केत गर्न कोष्ठक [] प्रयोग गरिन्छ ।
// This is an array of strings
let fruits = ["apple", "banana", "pineapple", "strawberry"];

// We set the variable banana to the value of the second element of
// the fruits array. Remember that indices start at 0, so 1 is the
// second element. Result: banana = "banana"
let banana = fruits[1];

You can also use an array index to set the value of an element in an array:
तपाईँले सरणीमा तत्वको मान सेट गर्न सरणी अनुक्रमणिका पनि प्रयोग गर्न सक्नुहुन्छ ।
let array = ['a', 'b', 'c', 'd', 'e'];
//  indices:  0    1    2    3    4
array[4] = 'f';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f']

Note that if you try to access or set an element using an index that is outside the bounds of the array (i.e., an index that is less than 0 or greater than or equal to the length of the array), you will get an undefined value.
याद गर्नुहोस् कि यदि तपाईँले सरणीको सीमा भन्दा बाहिरको अनुक्रमणिका प्रयोग गरेर तत्व पहुँच गर्न वा सेट गर्न प्रयास गर्नुभयो भने (जस्तै, ० भन्दा कम वा सरणीको लम्बाइभन्दा बढी वा बराबर अनुक्रमणिका), तपाईँले अपरिभाषित मान प्राप्त गर्नुहुनेछ।
console.log(array[5]); // Output: undefined
array[5] = 'g';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f', undefined, 'g']

loops/.body:
Loops
Loops are repetitive conditions where one variable in the loop changes. Loops are handy, if you want to run the same code over and over again, each time with a different value.
लूपहरू दोहोरिने अवस्थाहरू हुन् जहाँ लूपमा एक चर परिवर्तन हुन्छ। लुपहरू सजिलो छन्, यदि तपाईं एउटै कोड पटक-पटक चलाउन चाहनुहुन्छ भने, प्रत्येक पटक फरक मानको साथ।
