for (var i = 0; i

loops/for.html.body:
For
The easiest form of a loop is the for statement. This one has a syntax that is similar to an if statement, but with more options:
लुपको सब भन्दा सजिलो रूप फर हो। 
for (condition; end condition; change) {
    // do it, do it now
}

Let's see how to execute the same code ten-times using a for loop:
 हामीले फर लूप प्रयोग गरेर दस पटक एउटै कोड कसरी कार्यान्वयन गर्छौ, हेरौं ।
for (let i = 0; i 

Note: i = i + 1 can be written i++.
नोट:  i = i + 1 लागि यसरि लेख्न सकिन्छ i++।

To loop through the properties of an object or an array for in loop can also be used.
एक वस्तु वा एरे फर इन  लूपको गुणहरू मार्फत लूप गर्न पनि प्रयोग गर्न सकिन्छ।
for (key in object) {
  // code block to be executed
}

Examples of for in loop for an object and array is shown below:
वस्तु र एरेका लागि फर इन` लूपका उदाहरणहरू तल देखाइएको छ।
const person = {fname:"John", lname:"Doe", age:25};
let info = "";
for (let x in person) {
  info += person[x];
}

// Result: info = "JohnDoe25"

const numbers = [45, 4, 9, 16, 25];
let txt = "";
for (let x in numbers) {
  txt += numbers[x];
}

// Result: txt = '45491625'

The value of iterable objects such as Arrays, Strings, Maps, NodeLists can be looped using for of statement.
पुनरावृत्ति योग्य वस्तुहरूको मान जस्तै एरे, स्ट्रिङ्स, म्याप्स, नोडलिस्ट्स को लागि कथन प्रयोग गरेर लुप गर्न सकिन्छ।
let language = "JavaScript";
let text = "";
for (let x of language) {
text += x;
}

loops/dowhile.html.body:
Do...While
डु ... वहाइल
The do...while statement creates a loop that executes a specified statement until the test condition evaluates to be false. The condition is evaluated after executing the statement. The syntax for do... while is
डु ... वहाइल कथनले लूप सिर्जना गर्दछ । यसले तबसम्म निर्दिष्ट कथन कार्यान्वयन गर्दछ जबसम्म परीक्षण अवस्था गलत हुन को लागी मूल्यांकन गर्दैन। बयान कार्यान्वयन पछि अवस्था मूल्यांकन गरिन्छ।
do {
  // statement
} while (expression);

Lets for example see how to print numbers less than 10 using do...while loop:
उदाहरणका लागि हेरौं कसरी १० भन्दा कम नम्बरहरू मुद्रण गर्ने ।
var i = 0;
do {
  document.write(i + " ");
  i++; // incrementing i by 1
} while (i 

Note: i = i + 1 can be written i++.

functions/higher-order.html.body:
Higher order
उच्च अर्डर
Higher order functions are functions that manipulate other functions. For example, a function can take other functions as arguments and/or produce a function as its return value. Such fancy functional techniques are powerful constructs available to you in JavaScript and other high-level languages like python, lisp, etc.
"उच्च क्रम प्रकार्यहरू" प्रकार्यहरू हुन् जुन अन्य प्रकार्यहरू हेरफेर गर्दछ। उदाहरणका लागि, एक प्रकार्यले अन्य प्रकार्यहरू तर्कको रूपमा लिन सक्छ र / वा यसको रिटर्न मानको रूपमा प्रकार्य उत्पादन गर्न सक्छ। यस्तो fancy कार्यात्मक प्रविधिहरू जाभास्क्रिप्ट र अन्य उच्च-स्तरीय भाषाहरू जस्तै पाइथन, लिस्प, आदिमा तपाईंको लागि उपलब्ध शक्तिशाली संरचनाहरू हुन्।
We will now create two simple functions, add_2 and double, and a higher order function called map. map will accept two arguments, func and list (its declaration will therefore begin map(func,list)), and return an array. func (the first argument) will be a function that will be applied to each of the elements in the array list (the second argument).
अब हामी दुई सरल प्रकार्यहरू सिर्जना गर्नेछौं, add_2 र add_2, र map भनिने एक उच्च क्रम प्रकार्य। map ले दुई तर्कहरू स्वीकार गर्दछ, func र list (यसको घोषणाले यसैले map(func,list) सुरु गर्नेछ), र एक एरे फर्काउँछ। func (पहिलो तर्क) एक प्रकार्य हुनेछ जुन एरे list (दोस्रो तर्क) मा प्रत्येक तत्वमा लागू हुनेछ।
// Define two simple functions
let add_2 = function (x) {
  return x + 2;
};
let double = function (x) {
  return 2 * x;
};

// map is cool function that accepts 2 arguments:
//  func    the function to call
//  list    a array of values to call func on
let map = function (func, list) {
  let output = []; // output list
  for (idx in list) {
    output.push(func(list[idx]));
  }
  return output;
};

// We use map to apply a function to an entire list
// of inputs to "map" them to a list of corresponding outputs
map(add_2, [5, 6, 7]); // => [7, 8, 9]
map(double, [5, 6, 7]); // => [10, 12, 14]

The functions in the above example are simple. However, when passed as arguments to other functions, they can be composed in unforeseen ways to build more complex functions.
माथिको उदाहरणमा प्रकार्यहरू सरल छन्। तथापि, जब अन्य प्रकार्यहरूमा तर्कहरूको रूपमा पारित गरिन्छ, तिनीहरूलाई अधिक जटिल प्रकार्यहरू निर्माण गर्न अप्रत्याशित तरिकामा रचना गर्न सकिन्छ।
For example, if we notice that we use the invocations map(add_2, ...) and map(double, ...) very often in our code, we could decide we want to create two special-purpose list processing functions that have the desired operation baked into them. Using function composition, we could do this as follows:
उदाहरणका लागि, यदि हामी ध्यान दिन्छौं कि हामी आह्वानहरू map(add_2, ...) प्रयोग गर्दछौं। र map(double, ...) प्राय हाम्रो कोडमा, हामी निर्णय गर्न सक्छौं कि हामी दुई विशेष-उद्देश्य सूची प्रोसेसिंग प्रकार्यहरू सिर्जना गर्न चाहन्छौं जुन तिनीहरूमा इच्छित अपरेशन बेक गरिएको छ। प्रकार्य संरचना प्रयोग गरेर, हामी यसलाई निम्नानुसार गर्न सक्छौं:
process_add_2 = function (list) {
  return map(add_2, list);
};
process_double = function (list) {
  return map(double, list);
};
process_add_2([5, 6, 7]); // => [7, 8, 9]
process_double([5, 6, 7]); // => [10, 12, 14]

Now let's create a function called buildProcessor that takes a function func as input and returns a func-processor, that is, a function that applies func to each input in list.
अब buildProcessor नामक प्रकार्य सिर्जना गरौं जसले प्रकार्य func लाई इनपुटको रूपमा लिन्छ र func -प्रोसेसर फर्काउँछ, अर्थात्, एक प्रकार्य जसले सूचीमा प्रत्येक इनपुटमा func लागू गर्दछ।
// a function that generates a list processor that performs
let buildProcessor = function (func) {
  let process_func = function (list) {
    return map(func, list);
  };
  return process_func;
};
// calling buildProcessor returns a function which is called with a list input

// using buildProcessor we could generate the add_2 and double list processors as follows:
process_add_2 = buildProcessor(add_2);
process_double = buildProcessor(double);

process_add_2([5, 6, 7]); // => [7, 8, 9]
process_double([5, 6, 7]); // => [10, 12, 14]

Let's look at another example. We'll create a function called buildMultiplier that takes a number x as input and returns a function that multiplies its argument by x :
अर्को उदाहरण हेरौं। हामी buildMultiplier नामक प्रकार्य सिर्जना गर्नेछौं जसले संख्या x लाई इनपुटको रूपमा लिन्छ र प्रकार्य फर्काउँछ जसले यसको तर्कलाई x ले गुणा गर्दछ:
let buildMultiplier = function (x) {
  return function (y) {
    return x * y;
  };
};

let double = buildMultiplier(2);
let triple = buildMultiplier(3);

double(3); // => 6
triple(3); // => 9

objects/properties.html.body:
Properties
गुणहरू
Object's property is a propertyName: propertyValue pair, where property name can be only a string. If it's not a string, it gets casted into a string. You can specify properties when creating an object or later. There may be zero or more properties separated by commas.
वस्तुको प्रोपर्टी propertyName हो: propertyValue जोडी, जहाँ गुण नाम स्ट्रिङ मात्र हुन सक्छ । यदि यो स्ट्रिङ होइन भने, यो एक स्ट्रिंगमा फ्याँकिन्छ। वस्तु वा पछि सिर्जना गर्दा तपाईँले गुण निर्दिष्ट गर्न सक्नुहुन्छ । अल्पविरामद्वारा छुट्याइएको शून्य वा बढी गुणहरू हुन सक्छन्।
let language = {
  name: "JavaScript",
  isSupportedByBrowsers: true,
  createdIn: 1995,
  author: {
    firstName: "Brendan",
    lastName: "Eich",
  },
  // Yes, objects can be nested!
  getAuthorFullName: function () {
    return this.author.firstName + " " + this.author.lastName;
  },
  // Yes, functions can be values too!
};

The following code demonstrates how to get a property's value.
निम्न कोडले कसरी सम्पत्तिको मूल्य प्राप्त गर्ने भनेर देखाउँछ।
let variable = language.name;
// variable now contains "JavaScript" string.
variable = language["name"];
// The lines above do the same thing. The difference is that the second one lets you use litteraly any string as a property name, but it's less readable.
variable = language.newProperty;
// variable is now undefined, because we have not assigned this property yet.

The following example shows how to add a new property or change an existing one.
निम्न उदाहरणले कसरी नयाँ गुण थप्ने वा अवस्थित गुण परिवर्तन गर्ने भनेर देखाउँछ।
language.newProperty = "new value";
// Now the object has a new property. If the property already exists, its value will be replaced.
language["newProperty"] = "changed value";
// Once again, you can access properties both ways. The first one (dot notation) is recomended.

objects/prototype.html.body:
Prototype
प्रोटोटाइप
Every object is linked to a prototype object from which it inherits properties.
प्रत्येक वस्तु एक प्रोटोटाइप वस्तुसँग जोडिएको छ जसबाट यसले गुणहरू प्राप्त गर्दछ।
All objects created from object literals ({}) are automatically linked to Object.prototype, which is an object that comes standard with JavaScript.
वस्तु शाब्दिक ({}) बाट सिर्जना गरिएका सबै वस्तुहरू स्वचालित रूपमा Object.prototype सँग लिङ्क हुन्छन्, जुन जाभास्क्रिप्टको साथ मानक आउने वस्तु हो।
When a JavaScript interpreter (a module in your browser) tries to find a property, which You want to retrieve, like in the following code:
जब जाभास्क्रिप्ट दुभाषिया (तपाईंको ब्राउजरमा एक मोड्युल) ले एउटा गुण फेला पार्ने प्रयास गर्दछ, जुन तपाईं पुन: प्राप्त गर्न चाहनुहुन्छ, जस्तै निम्न कोडमा:
let adult = { age: 26 },
  retrievedProperty = adult.age;
// The line above

First, the interpreter looks through every property the object itself has. For example, adult has only one own property — age. But besides that one, it actually has a few more properties, which were inherited from Object.prototype.
पहिलो, दुभाषियाले वस्तुसँग भएका हरेक सम्पत्तिलाई हेर्छ। उदाहरणका लागि, adult को आफ्नै सम्पत्ति छ- age। तर त्यो बाहेक, यसमा वास्तवमा केहि अन्य गुणहरू छन्, जुन Object.prototype बाट विरासतमा प्राप्त भएको थियो।
let stringRepresentation = adult.toString();
// the variable has value of '[object Object]'

toString is an Object.prototype's property, which was inherited. It has a value of a function, which returns a string representation of the object. If you want it to return a more meaningful representation, then you can override it. Simply add a new property to the adult object.
toString एक Object.prototype's प्रोपर्टी हो, जुन विरासतमा प्राप्त भएको थियो। यसमा प्रकार्यको मान छ, जसले वस्तुको स्ट्रिङ प्रतिनिधित्व फर्काउँछ। यदि तपाईं यसलाई अझ अर्थपूर्ण प्रतिनिधित्व फिर्ता गर्न चाहनुहुन्छ भने, तपाईं यसलाई ओभरराइड गर्न सक्नुहुन्छ। बस वयस्क वस्तुमा नयाँ गुण थप्नुहोस्।
adult.toString = function () {
  return "I'm " + this.age;
};

If you call the toString function now, the interpreter will find the new property in the object itself and stop.
यदि तपाईंले अहिले toString प्रकार्यलाई कल गर्नुभयो भने, दुभाषियाले वस्तुमा नै नयाँ गुण फेला पार्नेछ र रोक्नेछ।
Thus the interpreter retrieves the first property it will find on the way from the object itself and further through its prototype.
यसैले दुभाषियाले पहिलो सम्पत्ति पुन: प्राप्त गर्दछ जुन यसले वस्तुबाट नै बाटोमा फेला पार्नेछ र यसको प्रोटोटाइपमार्फत थप।
To set your own object as a prototype instead of the default Object.prototype, you can invoke Object.create as follows:
पूर्वनिर्धारित वस्तु.प्रोटोटाइपको सट्टाप्रोटोटाइपको रूपमा तपाईँको आफ्नै वस्तु सेट गर्न, तपाईँले निम्नानुसार Object.create आह्वान गर्न सक्नुहुन्छ:
let child = Object.create(adult);
/* This way of creating objects lets us easily replace the default Object.prototype with the one we want. In this case, the child's prototype is the adult object. */
child.age = 8;
/* Previously, child didn't have its own age property, and the interpreter had to look further to the child's prototype to find it.
 Now, when we set the child's own age, the interpreter will not go further.
 Note: adult's age is still 26. */
let stringRepresentation = child.toString();
// The value is "I'm 8".
/* Note: we have not overridden the child's toString property, thus the adult's method will be invoked. If adult did not have toString property, then Object.prototype's toString method would be invoked, and we would get "[object Object]" instead of "I'm 8" */

child's prototype is adult, whose prototype is Object.prototype. This sequence of prototypes is called a  prototype chain.
'बच्चाको' प्रोटोटाइप 'वयस्क' हो, जसको प्रोटोटाइप 'वस्तु.प्रोटोटाइप' हो। प्रोटोटाइपको यस अनुक्रमलाई प्रोटोटाइप चेन भनिन्छ।

objects/enumeration.html.body:
Enumeration
गणना[सम्पादन गर्ने]
Enumeration refers to the process of iterating over the properties of an object and performing a certain action for each property. There are several ways to enumerate the properties of an object in JavaScript.
गणनाले वस्तुको गुणहरू माथि पुनरावृत्ति गर्ने र प्रत्येक गुणको लागि निश्चित कार्य गर्ने प्रक्रियालाई बुझाउँछ। जाभास्क्रिप्टमा वस्तुको गुणहरू गणना गर्ने धेरै तरिकाहरू छन्।
One way to enumerate the properties of an object is to use the for-in loop. The for-in loop iterates over the enumerable properties of an object in an arbitrary order, and for each property it executes a given block of code.
वस्तुको गुणहरू गणना गर्ने एउटा तरिका भनेको 'फोर-इन' लूप प्रयोग गर्नु हो। 'फर-इन' लूपले वस्तुको गणना योग्य गुणहरू माथि स्वेच्छाचारी क्रममा पुनरावृत्ति गर्दछ, र प्रत्येक गुणको लागि यसले कोडको दिइएको ब्लक कार्यान्वयन गर्दछ।
The for in statement can loop over all of the property names in an object. The enumeration will include functions and prototype properties.
'फोर-इनका लागि' कथनले वस्तुमा सबै सम्पत्ति नामहरू लुप गर्न सक्छ। गणनामा प्रकार्यहरू र प्रोटोटाइप गुणहरू समावेश हुनेछन्।
let fruit = {
    apple: 2,
    orange: 5,
    pear: 1,
  },
  sentence = "I have ",
  quantity;
for (kind in fruit) {
  quantity = fruit[kind];
  sentence += quantity + " " + kind + (quantity === 1 ? "" : "s") + ", ";
}
// The following line removes the trailing comma.
sentence = sentence.substr(0, sentence.length - 2) + ".";
// I have 2 apples, 5 oranges, 1 pear.

Another way to enumerate the properties of an object is to use the Object.keys() method, which returns an array of the object's own enumerable property names.
वस्तुको गुणहरू गणना गर्ने अर्को तरिका Object.keys() विधि प्रयोग गर्नु हो, जसले वस्तुको आफ्नै गणना योग्य गुण नामहरूको सरणी फर्काउँछ।
For example:
उदाहरणको लागी:
let object = {
  foo: 'bar',
  baz: 'qux'
};

let properties = Object.keys(object);
properties.forEach(function(property) {
  console.log(property + ': ' + object[property]);
});

// foo: bar
// baz: qux

classes/access-modifiers.html.body:
Access Modifiers
पहुँच परिमार्जनकर्ताहरू
public, private, and protected are the three access modifiers used in class to control its access from the outside. By default, all members (properties, fields, methods, or functions) are publicly accessible from outside the class.
public, private, र protected  तीन पहुँच परिमार्जकहरू हुन् जुन कक्षामा बाहिरबाट यसको पहुँच नियन्त्रण गर्न प्रयोग गरिन्छ। पूर्वनिर्धारित रूपमा, सबै सदस्यहरू (गुणहरू, क्षेत्रहरू, विधिहरू, वा प्रकार्यहरू) वर्ग बाहिरबाट सार्वजनिक रूपमा पहुँच योग्य छन्।
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
}
let myCar = new Car("Toyota");
console.log(Car.hello(myCar)); // Hello Toyota

private  members can access only internally within the class and cannot be accessible from outside.  Private should start with #.
private सदस्यहरूले कक्षाभित्र मात्र आन्तरिक रूपमा पहुँच गर्न सक्दछन् र बाहिरबाट पहुँच योग्य हुन सक्दैनन्।  प्राइभेट # बाट सुरु गर्नुपर्छ ।
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
  #present(carname) {
    return 'I have a ' + this.carname;
  }
}
let myCar = new Car("Toyota");
console.log(myCar.#present("Camry")); // Error
console.log(Car.hello(myCar)); // Hello Toyota

protected fields are accessible only from inside the class and those extending it. These are useful for the internal interface as the inheriting class also gains access to the parent class.  Protected fields with _ .
protected क्षेत्रहरू वर्ग भित्र र यसलाई विस्तार गर्नेहरूबाट मात्र पहुँचयोग्य छन्। यी आन्तरिक इन्टरफेसको लागि उपयोगी छन् किनकि उत्तराधिकारी वर्गले अभिभावक वर्गमा पनि पहुँच प्राप्त गर्दछ।  _ सँग संरक्षित फाँटहरू ।
class Car {
  constructor(brand) {
    this.carname = brand;
  }
  _present() {
    return 'I have a ' + this.carname;
  }
}

class Model extends Car {
  constructor(brand, mod) {
    super(brand);
    this.model = mod;
  }
  show() {
    return this._present() + ', it is a ' + this.model;
  }
}

let myCar = new Model("Toyota", "Camry");
console.log(myCar.show()) // I have a Toyota, it is a Camry

browser-object-model-bom/popup.html.body:
Popup
पपअप
Popups are an additional way to show information, take user confirmation, or take user input from additional documents. A popup can navigate to a new URL and send information to the opener window. Alert box, Confirmation box,  and Prompt box are the global functions where we can show the popup information.
पपअपहरू जानकारी देखाउन, प्रयोगकर्ता पुष्टिकरण लिन, वा थप कागजातहरूबाट प्रयोगकर्ता इनपुट लिनको लागि एक अतिरिक्त तरिका हो। पपअपले नयाँ यूआरएलमा नेभिगेट गर्न सक्दछ र ओपनर सञ्झ्यालमा सूचना पठाउन सक्छ। चेतावनी बाकस, पुष्टि बाकस, र प्रॉम्प्ट बक्स विश्वव्यापी प्रकार्यहरू हुन् जहाँ हामी पपअप जानकारी देखाउन सक्छौं।

alert(): It displays information to the user and has an  "OK" button to proceed.
 यसले प्रयोगकर्तालाई जानकारी प्रदर्शित गर्दछ र अगाडि बढ्नका लागि "OK" बटन छ।
 alert("Alert message example");


confirm(): Use as a dialog box to confirm or accept something. It has "Ok" and "Cancel" to proceed. If the user clicks "Ok" then it returns true, if click "Cancel" it returns  false.
कुनै कुरा पुष्टि गर्न वा स्वीकार गर्न संवाद बाकसको रूपमा प्रयोग गर्नुहोस् । यसमा "OK" र "Cancel" अगाडि बढ्नको लागि छ। यदि प्रयोगकर्ताले "OK" क्लिक गर्दछ भने यसले 'सत्य' फर्काउँछ, यदि "Cancel" क्लिक गर्दा यसले 'गलत' फर्काउँछ।
let txt;
if (confirm("Press a button!")) {
  txt = "You pressed OK!";
} else {
  txt = "You pressed Cancel!";
}


prompt(): Takes user input value with "Ok" and "Cancel" buttons. It returns null if the user does not provide any input value.
"OK" र "Cancel" बटनसँग प्रयोगकर्ता आगत मान लिन्छ। यदि प्रयोगकर्ताले कुनै आगत मान प्रदान गरेन भने यसले 'नल' फर्काउँछ ।
//syntax 
//window.prompt("sometext","defaultText");

let person = prompt("Please enter your name", "Harry Potter");

if (person == null || person == "") {
  txt = "User cancelled the prompt.";
} else {
  txt = "Hello " + person + "! How are you today?";
}

miscellaneous/template-literals.html.body:
Template Literals
टेम्प्लेट शाब्दिक
Template literals are literals delaminated with backtick (``) and are used in variable and expression interpolation into strings. 
टेम्प्लेट शाब्दिक हरू ब्याकटिक (``) को साथ डिलेमिनेटेड शाब्दिकहरू हुन् र स्ट्रिंगहरूमा चर र अभिव्यक्ति प्रक्षेपमा प्रयोग गरिन्छ।
let text = `Hello World!`;
// template literals with both single and double code inside a single string
let text = `He's often called "Johnny"`;
// template literals with multiline strings
let text =
`The quick
brown fox
jumps over
the lazy dog`;

// template literals with variable interpolation
const firstName = "John";
const lastName = "Doe";

const welcomeText = `Welcome ${firstName}, ${lastName}!`;

// template literals with expression interpolation
const price = 10;
const VAT = 0.25;

const total = `Total: ${(price * (1 + VAT)).toFixed(2)}`;

miscellaneous/hoisting.html.body:
Hoisting
होइस्टिंग
Hosting is a default behavior in JavaScript of moving declarations at the top.  While executing a code, it creates a global execution context:  creation and execution.  In the creation phase, JavaScript moves the variable and function declaration to the top of the page, which is known as hoisting. 
होस्टिङ जाभास्क्रिप्टमा पूर्वनिर्धारित व्यवहार हो जुन शीर्षमा घोषणाहरू सार्ने छ।  एक कोड कार्यान्वयन गर्दा, यसले विश्वव्यापी कार्यान्वयन सन्दर्भ सिर्जना गर्दछ: सिर्जना र कार्यान्वयन।  सिर्जना चरणमा, जाभास्क्रिप्टले चर र प्रकार्य घोषणालाई पृष्ठको शीर्षमा सार्दछ, जुन उत्थानको रूपमा चिनिन्छ।
// variable hoisting
console.log(counter);
let counter = 1; // throws ReferenceError: Cannot access 'counter' before initialization

Although the counter is present in the heap memory but hasn't been initialized so, it throws an error. This happens because of hoisting, the counter variable is hoisted here. 
यद्यपि 'काउन्टर' ढेर मेमोरीमा अवस्थित छ तर सुरु गरिएको छैन, यसले त्रुटि फ्याँक्छ। यो फहराउने कारण हुन्छ, 'काउन्टर' चर यहाँ फहराइन्छ।;
// function hoisting
const x = 20,
    y = 10;

let result = add(x,y); // ❌ Uncaught ReferenceError: add is not defined
console.log(result);

let add = (x, y) => x + y;


Here, the add function is hoisted and initialized with undefined in heap memory in the creation phase of the global execution context. Thus, throwing an error. 
यहाँ, add प्रकार्य निस्कियो र विस्तृत जानकारीको रूपमा` अपरिभाइनको साथ आरम्भ गरिएको छ। यसैले, त्रुटि फ्याँक्दै।

template-literals/currying.html.body:
Currying
करिङ
Currying is an advanced technique in functional programming of transforming a function with multiple arguments into a sequence of nesting functions. It transforms a function from callable  f(a,b,c) into callable as f(a)(b)(c). It doesn’t call a function instead it transforms it.
'करिङ' कार्यात्मक प्रोग्रामिंगमा एक उन्नत प्रविधि हो जुन धेरै तर्कहरूको साथ एक प्रकार्यलाई नेस्टिंग प्रकार्यहरूको अनुक्रममा रूपान्तरण गर्दछ। यसले प्रकार्यलाई f(a,b,c) बाट f(a)(b)(c) को रूपमा कल गर्न योग्यमा रूपान्तरण गर्दछ। यसले प्रकार्यलाई कल गर्दैन बरु यसलाई रूपान्तरण गर्दछ।
To get a better understanding of currying let’s create a simple add function add that takes three arguments and returns the sum of them. Then, we create a addCurry function that takes a single input and returns a series of functions with its sum.
करिङको राम्रो समझ प्राप्त गर्न एक साधारण add प्रकार्य थप्नुहोस् सिर्जना गरौं जुन तीन तर्कहरू लिन्छ र तिनीहरूको योगफल फर्काउँछ। त्यसपछि, हामी एक addCurry प्रकार्य सिर्जना गर्दछौं जसले एकल इनपुट लिन्छ र यसको योगफलको साथ प्रकार्यहरूको श्रृंखला फर्काउँछ।
// Noncurried version
const add = (a, b, c)=>{
    return a+ b + c
}
console.log(add(2, 3, 5)) // 10

// Curried version
const addCurry = (a) => {
    return (b)=>{
        return (c)=>{
            return a+b+c
        }
    }
}
console.log(addCurry(2)(3)(5)) // 10

Here, we can see that both the curried and noncurried versions returned the same result. Currying can be beneficial for many reasons, some of which are mentioned here.
यहाँ, हामी देख्न सक्छौं कि दुवै करीड र गैर-करी संस्करणहरूले समान परिणाम फर्काए। करी गर्नु धेरै कारणहरूको लागि लाभदायक हुन सक्छ, जसमध्ये केही यहाँ उल्लेख गरिएको छ।

It helps to avoid passing the same variable again and again.(यसले एउटै चरलाई बारम्बार पास गर्नबाट जोगिन मद्दत गर्दछ।)

It divides the function into smaller chunks with a single responsibility, making the function less error-prone.(यसले प्रकार्यलाई एकल जिम्मेवारीको साथ सानो खण्डहरूमा विभाजन गर्दछ, जसले प्रकार्यलाई कम त्रुटि-प्रवण बनाउँदछ।)

It is used in functional programming to create a high-order function.(यो एक उच्च-क्रम प्रकार्य सिर्जना गर्न कार्यात्मक प्रोग्रामिंगमा प्रयोग गरिन्छ।)

template-literals/linked-list/add.html.body:
Add
जोड्नु
The add method is created here to add value to a linked list.
लिङ्क गरिएको सूचीमा मान थप्न यहाँ add विधि सिर्जना गरिएको छ ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    append = (value) => {
        const newNode = new Node(value) 
        let current = this.head 
        if (!this.head) {
            this.head = newNode 
            return 
        }
        while (current.next) {
            current = current.next
        }
        current.next = newNode
    }
}

template-literals/linked-list/pop.html.body:
Pop
पप
Here, a pop method is created to remove a value from the linked list.
यहाँ, लिङ्क गरिएको सूचीबाट मान हटाउन 'पप' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    pop = () => {
        let current = this.head 
        while (current.next.next) {
            current = current.next 
        }
        current.next = current.next.next 
    }
}

template-literals/linked-list/prepend.ht.body:
Prepend
प्रिपेन्ड
Here, a prepend method is created to add a value before the first child of the linked list.
यहाँ, लिङ्क गरिएको सूचीको पहिलो बच्चा भन्दा पहिले मान थप्न 'प्रिपेन्ड' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    prepend = (value) => {
        const newNode = new Node(value)
        if (!this.head) {
            this.head = newNode 
        }
        else {
            newNode.next = this.head 
            this.head = newNode 
        }
    }
}

