Here, the shift method is created to remove the first element of the Linked List.
यहाँ, लिङ्क गरिएको सूचीको पहिलो तत्व हटाउन 'सिफ्ट' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    shift = () => {
        this.head = this.head.next 
    }
}

template-literals/global-footprint.html.body:
Global footprint
ग्लोबल पदचिह्न
If you are developing a module, which might be running on a web page, which also runs other modules, then you must beware  of the variable name overlapping.
यदि तपाईं मोड्युल विकास गर्दै हुनुहुन्छ, जुन वेब पृष्ठमा चलिरहेको हुन सक्छ, जसले अन्य मोड्युलहरू पनि चलाउँदछ, त्यसपछि तपाईंले चर नाम ओभरल्यापिङको बारेमा सावधान हुनुपर्दछ।
Suppose we are developing a counter module:
मानौं हामी काउन्टर मोड्युल विकास गर्दैछौं:
let myCounter = {
  number: 0,
  plusPlus: function () {
    this.number = this.number + 1;
  },
  isGreaterThanTen: function () {
    return this.number > 10;
  },
};


Note: this technique is often used with closures, to make the internal state immutable from the outside.
नोट: आन्तरिक अवस्थालाई बाहिरबाट अपरिवर्तनीय बनाउन यो प्रविधि प्रायः बन्द गरेर प्रयोग गरिन्छ।

The module now takes only one variable name — myCounter. If any other module on the page makes use of such names like number or isGreaterThanTen then it's perfectly safe because we will not override each other's values.
मोड्युलले अब केवल एक चर नाम लिन्छ - myCounter। यदि पृष्ठमा कुनै अन्य मोड्युलले 'नम्बर' वा isGreaterThanTen जस्ता नामहरू प्रयोग गर्दछ भने यो पूर्ण रूपमा सुरक्षित छ किनकि हामी एक अर्काको मानहरू ओभरराइड गर्नेछैनौं।

template-literals/debugging.html.body:
Debugging
डिबगिंग
In programming, errors can occur while writing code. It could be due to syntactical or logical errors. The process of finding errors can be time-consuming and tricky and is called code debugging.
प्रोग्रामिंगमा, कोड लेख्दा त्रुटिहरू हुन सक्छ। यो वाक्यात्मक वा तार्किक त्रुटिहरूको कारण हुन सक्छ। त्रुटिहरू फेला पार्ने प्रक्रिया समय-खपत र पेचिलो हुन सक्छ र यसलाई कोड डिबगिंग भनिन्छ।
Fortunately, most modern browsers come with built-in debuggers. These debuggers can be switched on and off, forcing errors to be reported. It is also possible to set up breakpoints during the execution of code to stop execution and examine variables. For this one has to open a debugging window and place the debugger keyword in the JavaScript code. The code execution is stopped in each breakpoint, allowing developers to examine the JavaScript values and, resume the execution of code.
सौभाग्यवश, अधिकांश आधुनिक ब्राउजरहरू बिल्ट-इन डिबगरहरूसँग आउँछन्। यी डिबगरहरू स्विच अन र अफ गर्न सकिन्छ, जसले त्रुटिहरू रिपोर्ट गर्न बाध्य पार्छ। कार्यान्वयन रोक्न र चरहरूको जाँच गर्न कोडको कार्यान्वयनको क्रममा ब्रेकपोइन्टहरू सेट अप गर्न पनि सम्भव छ। यसको लागि डिबगिङ विन्डो खोल्नुपर्छ र जाभास्क्रिप्ट कोडमा 'डिबगर' कीवर्ड राख्नुपर्छ। कोड कार्यान्वयन प्रत्येक ब्रेकपोइन्टमा रोकिन्छ, विकासकर्ताहरूलाई जाभास्क्रिप्ट मानहरू जाँच गर्न र कोडको कार्यान्वयन पुन: सुरु गर्न अनुमति दिन्छ।
One can also use the console.log() method to print the JavaScript values in the debugger window.
डिबगर सञ्झ्यालमा जाभास्क्रिप्ट मान मुद्रण गर्न console.log() विधि पनि प्रयोग गर्न सकिन्छ ।
const a = 5, b = 6;
const c = a + b;
console.log(c);
// Result : c = 11;

exercises/concatenation.html.body:
Concatenation
कन्काटेनेसन
In any programming language, string concatenation simply means appending one or more strings to another string. For example, when strings "World" and "Good Afternoon" are concatenated with string "Hello", they form the string "Hello World, Good Afternoon". We can concatenate a string in several ways in JavaScript.
कुनै पनि प्रोग्रामिंग भाषामा, स्ट्रिङ संयोजनको अर्थ केवल एक वा बढी स्ट्रिङहरू अर्को स्ट्रिङमा जोड्नु हो। उदाहरणका लागि, जब स्ट्रिङहरू "World" र "Good Afternoon" स्ट्रिङ "Hello" सँग संयोजन गरिन्छ, तिनीहरूले स्ट्रिङ "Hello World, Good Afternoon" बनाउँदछन्। हामी जाभास्क्रिप्टमा धेरै तरिकामा स्ट्रिङ संयोजन गर्न सक्दछौं।
Example:
const icon = '👋';

// using template Strings
`hi ${icon}`;

// using join() Method
['hi', icon].join(' ');

// using concat() Method
''.concat('hi ', icon);

//  using + operator
'hi ' + icon;

// RESULT
// hi 👋

📝 Task:

[ ] Write a program to set the values for str1and str2 so the code prints 'Hello World' to the console.

[ ]str1 र str2 का लागि मानहरू सेट गर्न कार्यक्रम लेख्नुहोस् ताकि कोडले कन्सोलमा 'Hello World' मुद्रण गर्दछ।


💡 Hints:

Visit the concatenation chapter of strings for more info about string concatenation.

स्ट्रिङ संयोजनको बारेमा थप जानकारीको लागि स्ट्रिङको संयोजन अध्यायमा जानुहोस्।

basics/variables.html.body:
Variables
The first step towards really understanding programming is looking back at algebra. If you remember it from school, algebra starts with writing terms such as the following.
वास्तवमा प्रोग्रामिंग बुझ्नको लागि पहिलो कदम बीजगणितमा फर्केर हेर्नु हो। यदि तपाईं यसलाई स्कूलबाट सम्झनुहुन्छ भने, बीजगणित निम्न जस्ता शब्दहरू लेख्दै सुरु हुन्छ।
3 + 5 = 8
You start performing calculations when you introduce an unknown, for example, x below:
तपाईँले अज्ञात परिचय दिंदा गणना हरू गर्न थाल्नुहुन्छ, उदाहरणका लागि, तल एक्स:
3 + x = 8
Shifting those around you can determine x:
तपाईं वरिपरि ती स्थानान्तरण एक्स निर्धारण गर्न सक्नुहुन्छ:
x = 8 - 3
-> x = 5
When you introduce more than one you make your terms more flexible - you are using variables:
जब तपाईं एक भन्दा बढी परिचय दिनुहुन्छ तपाईं आफ्नो सर्तहरू अधिक लचिलो बनाउनुहुन्छ - तपाईं चरहरू प्रयोग गर्दै हुनुहुन्छ:
x + y = 8
You can change the values of x and y and the formula can still be true:
तपाईँले x र y को मान परिवर्तन गर्न सक्नुहुन्छ र सूत्र अझै पनि सत्य हुन सक्छ:
x = 4
y = 4
or (अथवा)
x = 3
y = 5
The same is true for programming languages. In programming, variables are containers for values that change. Variables can hold all kinds of values and also the results of computations. Variables have a name and a value separated by an equals sign (=). Variable names can be any letter or word but bear in mind that there are restrictions from language to language of what you can use, as some words are reserved for other functionality.
प्रोग्रामिंग भाषाहरूको लागि पनि यही कुरा लागू हुन्छ। प्रोग्रामिंगमा, चरहरू परिवर्तन हुने मानहरूको लागि कन्टेनरहरू हुन्। चरहरूले सबै प्रकारका मानहरू र गणनाहरूको परिणामहरू पनि राख्न सक्दछन्। चलहरूको नाम र मान बराबर चिन्ह (=) द्वारा छुट्याइएको छ। परिवर्तनशील नामहरू कुनै पनि अक्षर वा शब्द हुन सक्छन् तर मनमा राख्नुहोस् कि तपाईंले प्रयोग गर्न सक्नुहुने भाषाबाट भाषामा प्रतिबन्धहरू छन्, किनकि केही शब्दहरू अन्य कार्यक्षमताका लागि आरक्षित छन्।
Let's check out how it works in Javascript, The following code defines two variables, computes the result of adding the two, and defines this result as a value of a third variable.
जाभास्क्रिप्टमा यसले कसरी काम गर्दछ भनेर जाँच गरौं, निम्न कोडले दुई चरहरू परिभाषित गर्दछ, दुई थप्ने परिणाम गणना गर्दछ, र यो परिणामलाई तेस्रो चरको मानको रूपमा परिभाषित गर्दछ।
let x = 5;
let y = 6;
let result = x + y;


