Define a variable `x` equal to 20.



	let x =

	let x = 20;
	assert(x == 20);



	    Submit
	    Solution


ES6 Version
ECMAScript 2015 or ES2015 also known as E6  is a significant update to the JavaScript programming language since 2009. In ES6 we have three ways of declaring variables. 
ईसीएमएस्क्रिप्ट 2015 वा ईएस 2015 लाई ई 6 पनि भनिन्छ 2009 देखि जाभास्क्रिप्ट प्रोग्रामिंग भाषामा एक महत्वपूर्ण अद्यावधिक हो। ईएस 6 मा हामीसँग चरहरू घोषणा गर्ने तीन तरिकाहरू छन्। &# X20;
var x = 5;
const y = 'Test';
let z = true;

घोषणाका प्रकारहरू दायरामा निर्भर गर्दछ। var कीवर्डको विपरीत, जसले ब्लक स्कोपको परवाह नगरी विश्वव्यापी वा स्थानीय रूपमा सम्पूर्ण प्रकार्यमा चर परिभाषित गर्दछ, let ले तपाईंलाई ब्लक, स्टेटमेन्ट, वा अभिव्यक्तिको दायरामा सीमित चरहरू घोषणा गर्न अनुमति दिन्छ जसमा तिनीहरू प्रयोग गरिन्छ। उदाहरणका लागी।
function varTest(){
    var x=1;
    if(true){
        var x=2; // same variable
        console.log(x); //2
    }
    console.log(x); //2
}

function letTest(){
    let x=1;
    if(true){
        let x=2;
        console.log(x); // 2
    }
    console.log(x); // 1
}

const variables are immutable - they are not allowed to be re-assigned.
कन्स्ट (const) भेरिएबलहरू अपरिवर्तनीय छन् - तिनीहरूलाई पुन: असाइन गर्न अनुमति छैन।
const x = "hi!";
x = "bye"; // this will occurs an error

basics/equality.html.body:
Equality
समानता
Programmers frequently need to determine the equality of variables in relation to other variables. This is done using an equality operator.
प्रोग्रामरहरूमा भ्यारीएबलहरूको सम्बन्धमा समानता निर्धारण गर्नुपर्दछ। यो समानता निर्धारण गर्न समानता अपरेटर प्रयोग गरेर गरिन्छ।
The most basic equality operator is the == operator. This operator does everything it can to determine if two variables are equal, even if they are not of the same type.
सब भन्दा आधारभूत अपरेटर समानता अपरेटर (==) हो। यस अपरेटरले यो निर्धारण गर्दछ कि दुई भ्यारीएबल बराबर छ कि छैन।
For example, assume:
let foo = 42;
let bar = 42;
let baz = "42";
let qux = "life";

foo == bar will evaluate to true and baz == qux will evaluate to false, as one would expect. However, foo == baz will also evaluate to true despite foo and baz being different types. Behind the scenes the == equality operator attempts to force its operands to the same type before determining their equality. This is in contrast to the === equality operator.
foo == bar को मूल्यांकन गर्दा साँचो र baz == qux को लागी झूटा को मूल्यांकन हुनेछ।foo र Bazबिभिन्न प्रकारका बावजुद foo == bazको मूल्यांकन साँचो हुनेछ। दृश्यहरूको पछाडि == समानता अपरेटरले आफ्नो समानता निर्धारण गर्नु अघि यसको प्रकारलाई अपरेट गर्दछ। यो === समानता अपरेटरको विपरित हो।
The === equality operator determines that two variables are equal if they are of the same type and have the same value. With the same assumptions as before, this means that foo === bar will still evaluate to true, but foo === baz will now evaluate to false. baz === qux will still evaluate to false.
 इकुअलिटी अपरेटरले (===)  दुई भ्यारीएबल बराबर र समान प्रकारका छन् भन्ने निर्धारण गर्दछ ।

