strings/replace.html.body:
Replace
प्रतिस्थापन
The replace method allows us to replace a character, word, or sentence with a string. For example.
प्रतिस्थापन विधिले हामीलाई क्यारेक्टर, शब्द वा वाक्यलाई स्ट्रिङले प्रतिस्थापन गर्न अनुमति दिन्छ। उदाहरणका लागि:
let str = "Hello World!";
let new_str = str.replace("Hello", "Hi");

console.log(new_str);

// Result: Hi World!

To replace a value on all instances of a regular expression with a g modifier is set.
परिमार्जकसँग नियमित अभिव्यक्तिको सबै उदाहरणहरूमा मान प्रतिस्थापन गर्न सेट गरिएको छ।

It searches for a string for a value or a regular expression and returns a new string with the value(s) replaced. It doesn't change the original string. Let's see the global case-insensitive replacement example.
यसले मान वा नियमित अभिव्यक्तिका लागि स्ट्रिङ खोजी गर्दछ र मान(हरू) प्रतिस्थापन गरिएको नयाँ स्ट्रिङ फर्काउँछ । यसले मूल स्ट्रिङ परिवर्तन गर्दैन। आउनुहोस् विश्वव्यापी केस-असंवेदनशील प्रतिस्थापन उदाहरण हेरौं।
let text = "Mr Blue has a blue house and a blue car";
let result = text.replace(/blue/gi, "red"); 

console.log(result); 
//Result: Mr red has a red house and a red car

strings/length.html.body:
Length
लम्बाइ
जाभास्क्रिप्टमा गुण .length प्रयोग गरेर स्ट्रिङमा कति क्यारेक्टरहरू छन् भनेर जान्न सजिलो छ। लम्बाइ गुणले स्ट्रिङमा क्यारेक्टरहरूको संख्या फर्काउँछ, खाली स्थान हरू र विशेष क्यारेक्टरहरू सहित।

let size = "Our lovely string".length;
console.log(size);
// size: 17

let emptyStringSize = "".length
console.log(emptyStringSize);
// emptyStringSize: 0

The length property of an empty string is 0.
खाली स्ट्रिङको लम्बाइ गुण ० हो ।
The length property is a read-only property, so you cannot assign a new value to it.
लम्बाइ गुण पढ्नका लागि मात्र प्रयोग गरिने गुण हो, त्यसैले तपाईँले यसमा नयाँ मान निर्दिष्ट गर्न सक्नुहुन्न ।

conditional/if.html.body:
If
यदि
The easiest condition is an if statement and its syntax is if(condition){ do this … }. The condition has to be true for the code inside the curly braces to be executed. You can for example test a string and set the value of another string dependent on its value:
सबै भन्दा सजिलो शर्त एक यदि कथन हो र यसको वाक्य रचना if (शर्त){ यो गर्नुहोस् ... }. घुँघराले ब्रेसेस भित्रको कोड कार्यान्वयन गर्नका लागि शर्त सही हुनुपर्दछ। उदाहरणका लागि तपाईँले स्ट्रिङ परीक्षण गर्न सक्नुहुन्छ र यसको मानमा निर्भर अर्को स्ट्रिङको मान सेट गर्न सक्नुहुन्छ।
let country = "France";
let weather;
let food;
let currency;

if (country === "England") {
  weather = "horrible";
  food = "filling";
  currency = "pound sterling";
}

if (country === "France") {
  weather = "nice";
  food = "stunning, but hardly ever vegetarian";
  currency = "funny, small and colourful";
}

if (country === "Germany") {
  weather = "average";
  food = "wurst thing ever";
  currency = "funny, small and colourful";
}

let message =
  "this is " +
  country +
  ", the weather is " +
  weather +
  ", the food is " +
  food +
  " and the " +
  "currency is " +
  currency;

console.log(message);
// 'this is France, the weather is nice, the food is stunning, but hardly ever vegetarian and the currency is funny, small and colourful'

Conditions can also be nested.
अवस्थाहरू पनि नेस्टेड गर्न सकिन्छ।

conditional/else.html.body:
Else
अन्य
There is also an else clause that will be applied when the first condition isn’t true. This is very powerful if you want to react to any value, but single out one in particular for special treatment:
त्यहाँ एक अन्य खण्ड पनि छ जुन लागू हुनेछ जब पहिलो शर्त सत्य छैन। यदि तपाईं कुनै पनि मूल्यमा प्रतिक्रिया गर्न चाहनुहुन्छ भने यो धेरै शक्तिशाली छ, तर विशेष उपचारको लागि विशेष गरी एक एकल:
let umbrellaMandatory;

if (country === "England") {
  umbrellaMandatory = true;
} else {
  umbrellaMandatory = false;
}

The else clause can be joined with another if. Let's remake the example from the previous article:
अन्य खण्ड अर्को यदि सँग जोड्न सकिन्छ। अघिल्लो लेखको उदाहरण लाई रिमेक गरौं।
if (country === "England") {
  ...
} else if (country === "France") {
  ...
} else if (country === "Germany") {
  ...
}


	Exercise

	    Correct!



	    False!




From the following values write a conditional statement that checks if `num1` is greater than `num2`. If it is, assign "num1 is greater than num2" to the `result` variable. If it is not, assign "num1 is less than or equal to num2".

निम्न मानहरूबाट एक सशर्त कथन लेख्नुहोस् जसले `num1` `num2` भन्दा ठूलो छ कि छैन भनेर जाँच गर्दछ। यदि यो छ भने, "परिणाम" चरमा `num1 num2 भन्दा ठूलो छ` असाइन गर्नुहोस्। यदि यो छैन भने, `num1 num2 भन्दा कम वा बराबर छ` असाइन गर्नुहोस्।



	let num1 = 10;
let num2 = 5;
let result;

// check if num1 is greater than num2
if( condition ) {

}else {

}

	let num1 = 10;
let num2 = 5;
let result;

// check if num1 is greater than num2
if (num1 > num2) {
  result = "num1 is greater than num2";
} else {
  result = "num1 is less than or equal to num2";
}
	assert(result == "num1 is greater than num2" );



	    Submit
	    Solution

conditional/switch.html.body:
Switch
स्विच
A switch is a conditional statement that performs actions based on different conditions. It uses strict ( === ) comparison to match the conditions and executes the code blocks of matched condition.  The syntax of the switch expression is shown below.
'स्विच' एक सशर्त कथन हो जुन विभिन्न अवस्थाहरूमा आधारित कार्यहरू गर्दछ। यसले शर्तहरू मिलान गर्न कडा ('==') तुलना प्रयोग गर्दछ र मिलान गरिएको अवस्थाको कोड ब्लकहरू कार्यान्वयन गर्दछ।  'स्विच' अभिव्यक्तिको वाक्यविन्यास तल देखाइएको छ ।
switch(expression) {
  case x:
    // code block
    break;
  case y:
    // code block
    break;
  default:
    // code block
}

The expression is evaluated once and is compared with each case. If a match is found, then the associated code block is executed if not default code block is executed. The break keyword stops the execution and can be placed anywhere. In its absence, the next condition is evaluated even if the conditions are not matched. 
अभिव्यक्ति एक पटक मूल्यांकन गरिएको छ र प्रत्येक मामला संग तुलना गरिएको छ। यदि म्याच फेला पर्यो भने, यदि 'पूर्वनिर्धारित' कोड ब्लक कार्यान्वयन गरिएको छैन भने सम्बन्धित कोड ब्लक कार्यान्वयन गरिन्छ। 'ब्रेक' कीवर्डले कार्यान्वयन रोक्छ र कहीं पनि राख्न सकिन्छ। यसको अनुपस्थितिमा, अर्को अवस्थाको मूल्यांकन गरिन्छ यदि शर्तहरू मेल खाँदैनन् भने पनि।
An example of getting a weekday name based on the switch condition is shown below. 
स्विच अवस्थाको आधारमा हप्ताको दिन को नाम प्राप्त गर्ने एक उदाहरण तल देखाइएको छ।
switch (new Date().getDay()) {
  case 0:
    day = "Sunday";
    break;
  case 1:
    day = "Monday";
    break;
  case 2:
     day = "Tuesday";
    break;
  case 3:
    day = "Wednesday";
    break;
  case 4:
    day = "Thursday";
    break;
  case 5:
    day = "Friday";
    break;
  case 6:
    day = "Saturday";
}

In multiple matching cases, the first matching value is selected, if not the default value is selected. In the absence of default and no matching case, the program continues to the next statement(s) after switch conditions. 
बहुविध मिल्दो अवस्थामा, पहिलो मिल्दो मान चयन गरिन्छ, यदि पूर्वनिर्धारित मान चयन गरिएको छैन भने। पूर्वनिर्धारित र कुनै मिल्दो केसको अनुपस्थितिमा, कार्यक्रम स्विच सर्तहरू पछि अर्को कथन(हरू) मा जारी रहन्छ।

	Exercise

	    Correct!



	    False!





From the following values write a `switch` statement that checks the value of dayOfWeek. If dayOfWeek is "Monday", "Tuesday", "Wednesday", "Thursday", or "Friday", assign "It's a weekday" to the result variable. If `dayOfWeek` is "Saturday" or "Sunday", assign "It's the weekend" to the result. 

निम्न मानहरूबाट 'स्विच' कथन लेख्नुहोस् जसले दिनको हप्ता को मान जाँच गर्दछ। यदि दिनअफवीक "सोमवार", "मंगलवार", "बुधवार", "बिहीबार", वा "शुक्रवार" हो भने, परिणाम चरमा "यो एक हप्ताको दिन हो" असाइन गर्नुहोस्। यदि 'डेअफवीक' "शनिबार" वा "आइतबार" हो भने, परिणाममा "यो सप्ताहांत हो" असाइन गर्नुहोस्।



	let dayOfWeek = "Monday";
let result;
// check if it's a weekday or the weekend
switch(expression) {
  case x:
    // code block
    break;
  case y:
    // code block
    break;
  default:
    // code block
}

	let dayOfWeek = "Monday";
let result;
// check if it's a weekday or the weekend
switch (dayOfWeek) {
  case "Monday":
  case "Tuesday":
  case "Wednesday":
  case "Thursday":
  case "Friday":
    result = "It's a weekday";
    break;
  case "Saturday":
  case "Sunday":
    result = "It's the weekend";
    break;
  default:
    result = "Invalid day of the week";
    break;
}
	assert(result == "It's a weekday" );



	    Submit
	    Solution

arrays/map.html.body:
Map
म्याप
The Array.prototype.map() method iterates over an array and modifies its elements using a callback function. The callback function will then be applied to each element of the array.
Array.prototype.map() विधिले एरेमा पुनरावृत्ति गर्दछ र कलब्याक प्रकार्य प्रयोग गरेर यसको तत्वहरू परिमार्जन गर्दछ। कलब्याक प्रकार्य त्यसपछि सरणीको प्रत्येक तत्वमा लागू हुनेछ।
Here's the syntax for using map:
यहाँ म्याप प्रयोग गर्नका लागि वाक्यरचना छ:
let newArray = oldArray.map(function(element, index, array) {
  // element: current element being processed in the array
  // index: index of the current element being processed in the array
  // array: the array map was called upon
  // Return element to be added to newArray
});

For example, let's say you have an array of numbers and you want to create a new array that doubles the values of the numbers in the original array. You could do this using map like this:
उदाहरणका लागि, मानौँ कि तपाईंसँग संख्याहरूको सरणी छ र तपाईं नयाँ सरणी सिर्जना गर्न चाहनुहुन्छ जसले मूल सरणीमा संख्याहरूको मानहरू डबल गर्दछ। तपाईं यो म्याप प्रयोग गरेर यो गर्न सक्नुहुन्छ:
const numbers = [2, 4, 6, 8];

const doubledNumbers = numbers.map(number => number * 2);

console.log(doubledNumbers);

// Result: [4, 8, 12, 16]

You can also use the arrow function syntax to define the function passed to map:
तपाईँले map() मा पास गरिएको प्रकार्य परिभाषित गर्न बाण प्रकार्य वाक्यविन्यास पनि प्रयोग गर्न सक्नुहुन्छ ।
let doubledNumbers = numbers.map((number) => {
  return number * 2;
});


or
let doubledNumbers = numbers.map(number => number * 2);

The map() method doesn't execute function for empty elements and doesn't change the original array.
map() विधिले खाली तत्वहरूका लागि प्रकार्य कार्यान्वयन गर्दैन र मौलिक एरे परिवर्तन गर्दैन ।

arrays/spread.html.body:
Spread
फैलने
An array or object can be quickly copied into another array or object by using the Spread Operator (...). It allows an iterable such as an array to be expanded in places where zero or more arguments (for function calls) or elements (for array literals) are expected, or an object expression to be expanded in places where zero or more key-value pairs (for object literals) are expected.
स्प्रेड अपरेटर (...) प्रयोग गरेर एरे वा वस्तुलाई अर्को सरणी वा वस्तुमा छिटो प्रतिलिपि गर्न सकिन्छ । यसले पुनरावृत्ति योग्य जस्तै सरणीलाई शून्य वा बढी तर्कहरू (प्रकार्य कलहरूका लागि) वा तत्वहरू (एरे शाब्दिकहरूका लागि) अपेक्षित स्थानहरूमा विस्तार गर्न अनुमति दिन्छ, वा वस्तु अभिव्यक्ति शून्य वा अधिक कुञ्जी-मान जोडीहरू (वस्तु शाब्दिकहरूका लागि) अपेक्षित स्थानहरूमा विस्तार गर्न अनुमति दिन्छ।
Here are some  examples of it:
यहाँ केहि उदाहरणहरू छन्:
let arr = [1, 2, 3, 4, 5]; 

console.log(...arr); 
// Result: 1 2 3 4 5

let arr1;
arr1 = [...arr]; //copies the arr into arr1 

console.log(arr1);    //Result: [1, 2, 3, 4, 5]

arr1 = [6,7];
arr = [...arr,...arr1];

console.log(arr);   //Result: [1, 2, 3, 4, 5, 6, 7]

The spread operator only works in modern browsers that support the feature. If you need to support older browsers, you will need to use a transpiler like Babel to convert the spread operator syntax to equivalent ES5 code.
स्प्रेड अपरेटरले केवल आधुनिक ब्राउजरहरूमा काम गर्दछ जुन सुविधालाई समर्थन गर्दछ। यदि तपाईंलाई पुरानो ब्राउजरहरू समर्थन गर्न आवश्यक छ भने, तपाईंले स्प्रेड अपरेटर वाक्यविन्यासलाई समकक्ष ईएस 5 कोडमा रूपान्तरण गर्न बाबेल जस्तो ट्रान्सपिलर प्रयोग गर्न आवश्यक हुनेछ।

arrays/shift.html.body:
Shift
सिफ्ट
shift deletes the first index of that array and moves all indexes to the left. It changes the original array. Here's the syntax for using shift:
सिफ्ट ले त्यो एरेको पहिलो अनुक्रमणिका मेट्दछ र सबै अनुक्रमणिकाहरू बायाँतिर सार्दछ। यसले मूल सरणी परिवर्तन गर्दछ। यहाँ 'शिफ्ट' प्रयोग गर्नका लागि वाक्यरचना छ:
array.shift();

For example: 
उदाहरणका लागि:
let array = [1, 2, 3]; 
array.shift(); 

// Result: array = [2,3]

You can also use the shift method in conjunction with a loop to remove all elements from an array. Here's an example of how you might do this:
एर्रेबाट सबै तत्वहरू हटाउन तपाईं लूपको संयोजनमा सिफ्ट विधि पनि प्रयोग गर्न सक्नुहुन्छ। तपाईं यो कसरी गर्न सक्नुहुन्छ को एक उदाहरण यहाँ छ:
while (array.length > 0) {
  array.shift();
}

console.log(array); // Result: []

The shift method only works on arrays, and not on other objects that are similar to arrays such as arguments objects or NodeList objects. If you need to shift elements from one of these types of objects, you will need to convert it to an array first using the Array.prototype.slice() method.
shift विधिले एरेहरूमा मात्र काम गर्दछ, न कि अन्य वस्तुहरूमा जुन एरेहरू जस्तै तर्क वस्तुहरू वा नोडलिस्ट वस्तुहरूसँग मिल्दोजुल्दो छ। यदि तपाईंलाई यी प्रकारका वस्तुहरूमध्ये कुनै एकबाट तत्वहरू स्थानान्तरण गर्न आवश्यक छ भने, तपाईंले यसलाई पहिले Array.prototype.slice() विधि प्रयोग गरेर एरेमा रूपान्तरण गर्न आवश्यक छ।

arrays/pop.html.body:
Pop
पप
The pop method removes the last element from an array and returns that element. This method changes the length of the array.
'पप' विधिले एरेबाट अन्तिम तत्व हटाउँदछ र त्यो तत्व फर्काउँछ। यो विधिले सरणीको लम्बाइ परिवर्तन गर्दछ ।
Here's the syntax for using pop:
यहाँ 'पप' प्रयोग गर्नका लागि वाक्यरचना छ:
array.pop();

For example:
उदाहरणको लागी:
let arr = ["one", "two", "three", "four", "five"]; 
arr.pop(); 

console.log(arr); 

// Result: ['one', 'two', 'three', 'four']

You can also use the pop method in conjunction with a loop to remove all elements from an array. Here's an example of how you might do this:
तपाईं एरेबाट सबै तत्वहरू हटाउन लूपको संयोजनमा 'पप' विधि पनि प्रयोग गर्न सक्नुहुन्छ। तपाईं यो कसरी गर्न सक्नुहुन्छ को एक उदाहरण यहाँ छ:
while (array.length > 0) {
  array.pop();
}

console.log(array); // Result: []

The pop method only works on arrays, and not on other objects that are similar to arrays such as arguments objects or NodeList objects. If you need to pop elements from one of these types of objects, you will need to convert it to an array first using the Array.prototype.slice() method.
पप विधिले एरेहरूमा मात्र काम गर्दछ, न कि अन्य वस्तुहरूमा जुन एरेहरू जस्तै तर्क वस्तुहरू वा नोडलिस्ट वस्तुहरूसँग मिल्दोजुल्दो छ। यदि तपाईंलाई यी प्रकारका वस्तुहरूमध्ये कुनै एकबाट तत्वहरू पप गर्न आवश्यक छ भने, तपाईंले यसलाई पहिले Array.prototype.slice() विधि प्रयोग गरेर सरणीमा रूपान्तरण गर्न आवश्यक छ।

arrays/join.html.body:
Join
सामेल
The join method, makes an array turn into a string and joins it all together. It does not change the original array. Here's the syntax for using join:
सामेल विधि, एक सरणी एक स्ट्रिंग मा बारी बनाउँछ र यो सबै एक साथ जोडिन्छ। यसले मूल सरणी परिवर्तन गर्दैन । यहाँ 'सामेल' प्रयोग गर्नका लागि वाक्यरचना छ:
array.join([separator]);

The separator argument is optional and specifies the character to be used to separate the elements in the resulting string. If omitted, the array elements are separated with a comma (,).
विभाजक (separator) तर्क वैकल्पिक छ र परिणामी स्ट्रिङमा तत्वहरू अलग गर्न प्रयोग गरिने क्यारेक्टर निर्दिष्ट गर्दछ। यदि छोडियो भने, सरणी तत्वहरू अल्पविराम (',') सँग अलग हुन्छन्।
For example:
उदाहरणको लागी:
let array = ["one", "two", "three", "four"]; 

console.log(array.join(" ")); 

// Result: one two three four

Any separator can be specified but the default one is a comma (,).
कुनै पनि विभाजक निर्दिष्ट गर्न सकिन्छ तर पूर्वनिर्धारित अल्पविराम (,) हो।

In the above example, a space is used as a separator. You can also use join to convert an array-like object (such as an arguments object or a NodeList object) to a string by first converting it to an array using the Array.prototype.slice() method:
माथिको उदाहरणमा, एक स्थान विभाजकको रूपमा प्रयोग गरिन्छ। तपाईँले एरे जस्तो वस्तु (जस्तै तर्क वस्तु वा नोडसूची वस्तु) लाई स्ट्रिङमा रूपान्तरण गर्न सामेल पनि प्रयोग गर्न सक्नुहुन्छ, यसलाई Array.prototype.slice() विधि प्रयोग गरेर सरणीमा रूपान्तरण गरेर:
function printArguments() {
  console.log(Array.prototype.slice.call(arguments).join(', '));
}

printArguments('a', 'b', 'c'); // Result: "a, b, c"

arrays/length.html.body:
Length
लम्बाइ
Arrays have a property called length, and it's pretty much exactly as it sounds, it's the length of the array.
एरेसँग लम्बा भनिने गुण छ, र यो एरेको लम्बाइ हो।
let array = [1, 2, 3];

let l = array.length;

// Result: l = 3

The length property also sets the number of elements in an array. For example.
लम्बाइ गुणले एरेमा तत्वहरूको संख्या पनि सेट गर्दछ। उदाहरणका लागि:
let fruits = ["Banana", "Orange", "Apple", "Mango"];
fruits.length = 2;

console.log(fruits);
// Result: ['Banana', 'Orange']

You can also use the length property to get the last element of an array by using it as an index. For example:
तपाईँले अनुक्रमणिकाको रूपमा प्रयोग गरेर सरणीको अन्तिम तत्व प्राप्त गर्न लम्बाइ गुण पनि प्रयोग गर्न सक्नुहुन्छ। उदाहरणका लागि:
console.log(fruits[fruits.length - 1]); // Result: Orange

You can also use the length property to add elements to the end of an array. For example:
सरणीको अन्त्यमा तत्वहरू थप्न तपाईँले लम्बाइ गुण पनि प्रयोग गर्न सक्नुहुन्छ । उदाहरणका लागि:
fruits[fruits.length] = "Pineapple";
console.log(fruits); // Result: ['Banana', 'Orange', 'Pineapple']

The length property is automatically updated when elements are added or removed from the array.
सरणीबाट तत्वहरू थप्दा वा हटाउँदा लम्बाइ गुण स्वचालित रूपमा अद्यावधिक हुन्छ।

It's also worth noting that the length property is not a method, so you don't need to use parentheses when accessing it. It's simply a property of the array object that you can access like any other object property.
यो पनि टिप्पण योग्य छ कि लम्बाइ गुण एक विधि होइन, त्यसैले तपाईं यसलाई पहुँच गर्दा कोष्ठक प्रयोग गर्न आवश्यक छैन।

arrays/for-each.html.body:
For Each
प्रत्येकको लागि
The forEach method executes a provided function once for each array element. Here's the syntax for using forEach:
फोरएच विधिले प्रत्येक सरणी तत्वका लागि एक पटक प्रदान गरिएको प्रकार्य कार्यान्वयन गर्दछ । यहाँ 'फोरएच' प्रयोग गर्नका लागि वाक्यरचना छ।
array.forEach(function(element, index, array) {
  // element: current element being processed in the array
  // index: index of the current element being processed in the array
  // array: the array forEach was called upon
});

For example, let's say you have an array of numbers and you want to print the double of each number to the console. You could do this using forEach like this:
उदाहरणका लागि, मानौँ कि तपाईंसँग संख्याहरूको सरणी छ र तपाईं कन्सोलमा प्रत्येक नम्बरको डबल मुद्रण गर्न चाहनुहुन्छ। तपाईं 'फोरएच' प्रयोग गरेर यो गर्न सक्नुहुनेछ:
let numbers = [1, 2, 3, 4, 5];
numbers.forEach(function(number) {
  console.log(number * 2);
});

You can also use the arrow function syntax to define the function passed to forEach:
तपाईँले फोरएच मा पास गरिएको प्रकार्य परिभाषित गर्न बाण प्रकार्य वाक्यरचना पनि प्रयोग गर्न सक्नुहुन्छ ।
numbers.forEach((number) => {
  console.log(number * 2);
});

or
अथवा
numbers.forEach(number => console.log(number * 2));

 forEach does not modify the original array. It simply iterates over the elements of the array and executes the provided function for each element.
फोरएच ले मूल एर्रे परिमार्जन गर्दैन । यो केवल एर्रेको तत्वहरूमा पुनरावृत्ति गर्दछ र प्रत्येक तत्वको लागि प्रदान गरिएको प्रकार्य कार्यान्वयन गर्दछ।
The forEach() method is not executed for the empty statment.
खाली कथनका लागि forEach() विधि कार्यान्वयन गरिएको छैन ।

loops/while.html.body:
While
वहाइल
While Loops repetitively execute a block of code as long as a specified condition is true.
वहाइल लूपहरूले निर्दिष्ट गरिएको अवस्था सत्य भएसम्म कोडको ब्लक पुनरावृत्ति रूपमा कार्यान्वयन गर्दछ।
while (condition) {
  // do it as long as condition is true
}

For example, the loop in this example will repetitively execute its block of code as long as the variable i is less than 5:
उदाहरणका लागि, वहाइल लूपले यसको कोडको ब्लकलाई पुनरावृत्ति रूपमा कार्यान्वयन गर्नेछ जबसम्म चर म ५ भन्दा कम छ:
var i = 0,
  x = "";
while (i 
Be careful to avoid infinite looping if the condition is always true!
यदि अवस्था सधैं साँचो छ भने अनन्त लूपिङबाट जोगिन होसियार हुनुहोस्!

objects/mutable.html.body:
Mutable
परिवर्तनीय
The difference between objects and primitive values is that we can change objects, whereas primitive values are immutable.
वस्तुहरू र आदिम मानहरू बीचको भिन्नता यो हो कि हामी वस्तुहरू परिवर्तन गर्न सक्छौं, जबकि आदिम मानहरू अपरिवर्तनीय हुन्।
For example:
उदाहरणको लागी:
let myPrimitive = "first value";
myPrimitive = "another value";
// myPrimitive now points to another string.
let myObject = { key: "first value" };
myObject.key = "another value";
// myObject points to the same object.

You can add, modify, or delete properties of an object using the dot notation or the square bracket notation.
तपाईँले डट नोटेसन वा स्क्वायर कोष्ठक नोटेसन प्रयोग गरेर वस्तुको गुण थप्न, परिमार्जन गर्न वा मेट्न सक्नुहुन्छ ।
let object = {};
object.foo = 'bar'; // Add property 'foo'
object['baz'] = 'qux'; // Add property 'baz'
object.foo = 'quux'; // Modify property 'foo'
delete object.baz; // Delete property 'baz'

Primitive values (such as numbers and strings) are immutable, while objects (such as arrays and objects) are mutable.
आदिम मानहरू (जस्तै संख्या र स्ट्रिङहरू) अपरिवर्तनीय छन्, जबकि वस्तुहरू (जस्तै एरे र वस्तुहरू) परिवर्तनशील छन्।

objects/reference.html.body:
Reference
सन्दर्भ
Objects are never copied. They are passed around by reference. An object reference is a value that refers to an object. When you create an object using the new operator or object literal syntax, JavaScript creates an object and assigns a reference to it.
वस्तुहरू प्रतिलिपि गर्न सकिँदैन । तिनीहरू सन्दर्भ द्वारा वरिपरि पारित छन्। वस्तु सन्दर्भ एउटा मान हो जसले वस्तुलाई बुझाउँछ। जब तपाईं new अपरेटर वा वस्तु शाब्दिक वाक्यरचना प्रयोग गरेर वस्तु सिर्जना गर्नुहुन्छ, जाभास्क्रिप्टले वस्तु सिर्जना गर्दछ र यसलाई सन्दर्भ प्रदान गर्दछ।
Here's an example of creating an object using the object literal syntax:
वस्तुको शाब्दिक वाक्यविन्यास प्रयोग गरेर वस्तु सिर्जना गर्ने उदाहरण यहाँ छ:
var object = {
  foo: 'bar'
};

Here's an example of creating an object using the new operator:
यहाँ new अपरेटर प्रयोग गरेर वस्तु सिर्जना गर्ने उदाहरण छ:
var object = new Object();
object.foo = 'bar';

When you assign an object reference to a variable, the variable simply holds a reference to the object, not the object itself. This means that if you assign the object reference to another variable, both variables will point to the same object.
जब तपाईँले एउटा चललाई वस्तु सन्दर्भ निर्दिष्ट गर्नुहुन्छ, चरले वस्तुको सन्दर्भ मात्र राख्छ, वस्तुलाई होइन। यसको अर्थ यो हो कि यदि तपाईँले वस्तु सन्दर्भलाई अर्को चरमा निर्दिष्ट गर्नुभयो भने, दुवै चलहरूले एउटै वस्तुलाई इंगित गर्नेछन्।
For example:
उदाहरणको लागी:
var object1 = {
  foo: 'bar'
};

var object2 = object1;

console.log(object1 === object2); // Output: true

In the example above, both object1 and object2 are variables that hold references to the same object. The === operator is used to compare the references, not the objects themselves, and it returns true because both variables hold references to the same object.
माथिको उदाहरणमा, object1 र object2 दुवै चरहरू हुन् जसले एउटै वस्तुको सन्दर्भ राख्छन्। === अपरेटर सन्दर्भहरू तुलना गर्न प्रयोग गरिन्छ, वस्तुहरू आफैलाई होइन, र यसले सत्य फर्काउँछ किनकि दुवै चरहरूले एउटै वस्तुमा सन्दर्भहरू राख्छन्।
You can use the Object.assign() method to create a new object that is a copy of an existing object. 
तपाईँले अवस्थित वस्तुको प्रतिलिपि भएको नयाँ वस्तु सिर्जना गर्न Object.assign() विधि प्रयोग गर्न सक्नुहुन्छ ।

Following is an example of an object by reference .
सन्दर्भद्वारा वस्तुको उदाहरण तल दिइएको छ ।
// Imagine I had a pizza
let myPizza = { slices: 5 };
// And I shared it with You
let yourPizza = myPizza;
// I eat another slice
myPizza.slices = myPizza.slices - 1;
let numberOfSlicesLeft = yourPizza.slices;
// Now We have 4 slices because myPizza and yourPizza
// reference to the same pizza object.
let a = {},
  b = {},
  c = {};
// a, b, and c each refer to a
// different empty object
a = b = c = {};
// a, b, and c all refer to
// the same empty object

objects/delete.html.body:
Delete
डिलिट
A delete property can be used to remove a property from an object. When a property is deleted, it is removed from the object and cannot be accessed or enumerated (i.e., it does not show up in a for-in loop).
'डिलिट(मेट्नुहोस्)' गुण वस्तुबाट गुण हटाउन प्रयोग गर्न सकिन्छ। जब कुनै गुण मेटिन्छ, यसलाई वस्तुबाट हटाइन्छ र पहुँच गर्न वा गणना गर्न सकिँदैन (जस्तै, यो फोर-इन लूपमा देखा पर्दैन)।
Here's the syntax for using delete:
यहाँ 'मेट्नुहोस्' प्रयोग गर्नका लागि वाक्यरचना छ:
delete object.property;

For example:
उदाहरणको लागी:
let adult = { age: 26 },
  child = Object.create(adult);

child.age = 8;

delete child.age;

/* Remove age property from child, revealing the age of the prototype, because then it is not overriden. */

let prototypeAge = child.age;
// 26, because child does not have its own age property.

The delete operator only works on own properties of an object, and not on inherited properties. It also does not work on properties that have the configurable attribute set to false.
'मेट्नुहोस्' अपरेटरले वस्तुको आफ्नै गुणहरूमा मात्र काम गर्दछ, र वंशानुगत गुणहरूमा होइन। यसले 'कन्फिगरेसन योग्य' विशेषता 'गलत' मा सेट गरिएको गुणहरूमा पनि काम गर्दैन।

The delete operator does not modify the object's prototype chain. It simply removes the specified property from the object and also it does not actually destroy the object or its properties. It simply makes the properties inaccessible. If you need to destroy an object and release its memory, you can set the object to null or use a garbage collector to reclaim the memory.
'मेट्नुहोस्' अपरेटरले वस्तुको प्रोटोटाइप श्रृंखला परिमार्जन गर्दैन। यसले केवल वस्तुबाट निर्दिष्ट गुण हटाउँदछ र यसले वास्तवमा वस्तु वा यसको गुणहरू नष्ट गर्दैन। यसले केवल गुणहरू पहुँच योग्य बनाउँदछ। यदि तपाईंलाई कुनै वस्तुलाई नष्ट गर्न र यसको मेमोरी छोड्न आवश्यक छ भने, तपाईं वस्तुलाई 'शून्य' मा सेट गर्न सक्नुहुन्छ वा मेमोरी पुनः प्राप्त गर्न फोहोर संकलक प्रयोग गर्न सक्नुहुन्छ।

error-handling/try...catch...finally.htm.body:
try...catch...finally
प्रयास ... क्याच ... अन्तमा
We can add one more construct to try...catch called finally, this code executes in all cases. i.e. after try when there is no error and after a catch in case of error. The syntax for try ...catch...finally is shown below.
हामी एक अर्को एक अर्डर थप्न सक्दछौं `प्रयास गर्नुहोस् ... क्याच" जसलाई 'अन्तमा' भनिन्छ, यो कोड सबै अवस्थामा कार्यान्वयन गर्दछ। अर्थात् 'प्रयास' पछि जब त्यहाँ कुनै त्रुटि छैन र त्रुटिको मामलामा 'क्याच' पछि। 'प्रयास गर्नुहोस् ... पकड़ो... अन्तमा' तल देखाइएको छ।
try {
   // try to execute the code
} catch (err) {
    // handle errors 
} finally {
   // execute always
}

Running real-world example code.
उदाहरणका लागि।
try {
  alert( 'try' );
} catch (err) {
  alert( 'catch' );
} finally {
  alert( 'finally' );
}

In the above example, the try block is executed first which is then followed by finally as there are no errors.
माथिको उदाहरणमा, `प्रयास ब्लकलाई कार्यान्वयन गरिएको छ जुन त्यसपछि अन्तमा" अन्ततः "कुनै त्रुटिहरू छैन भनेर अनुसरण गरिएको छ।

