एउटा प्रकार्य `divideNumbers()` लेख्नुहोस् जसले दुई तर्कहरू अंश र भाजक लिन्छ र निम्न सेटिङहरू प्रयोग गरेर भाजकद्वारा अंश विभाजन को परिणाम फर्काउँछ।



