modules.html.body:
Modules
मोड्युलहरू
In the real world, a program grows organically to cope with the needs of new functionality. With growing codebase structuring and maintaining the code requires additional work. Though it will pay off in the future, it's tempting to neglect it and allow programs to be deeply tangled. In reality, it increases the complexity of the application, as one is forced to build a holistic understanding of the system and has difficulty to look any piece in isolation. Secondly, one has to invest more time in untangling to use its functionality.
वास्तविक संसारमा, एक कार्यक्रम नयाँ कार्यक्षमताको आवश्यकताहरूको सामना गर्न व्यवस्थित रूपमा बढ्छ। बढ्दो कोडबेस संरचना र कोड को रखरखाव को साथ अतिरिक्त काम को आवश्यकता छ। यद्यपि यसले भविष्यमा भुक्तानी गर्नेछ, यसलाई बेवास्ता गर्न र कार्यक्रमहरूलाई गहिरो रूपमा पेचिलो हुन अनुमति दिन यो लोभलाग्दो छ। वास्तविकतामा, यसले अनुप्रयोगको जटिलता बढाउँछ, किनकि एक प्रणालीको समग्र समझ निर्माण गर्न बाध्य हुन्छ र अलगावमा कुनै पनि टुक्रा हेर्न गाह्रो हुन्छ। दोस्रो, यसको कार्यक्षमता को उपयोग गर्न को लागी एक अनटैंगलिंग मा अधिक समय लगानी गर्नु पर्छ।
Modules come to avoid these problems. A module specifies which pieces of code it depends on, along with what functionality it provides for other modules to use. Modules that are dependent on another module are called dependencies.  Various module libraries are there to organize code into modules and load it on demand.
मोड्युलहरू यी समस्याहरूबाट बच्न आउँदछन्। एक 'मोड्युल' ले निर्दिष्ट गर्दछ कि यो कोडको कुन टुक्राहरूमा निर्भर गर्दछ, साथै यसले अन्य मोड्युलहरू प्रयोग गर्नका लागि कुन कार्यक्षमता प्रदान गर्दछ। मोड्युलहरू जुन अन्य मोड्युलमा निर्भर छन् तिनीहरूलाई _निर्भरताहरू' भनिन्छ।  विभिन्न मोड्युल पुस्तकालयहरू मोड्युलहरूमा कोड व्यवस्थित गर्न र मागमा लोड गर्न त्यहाँ छन्।

AMD - one of the oldest module systems, initially used by require.js.

AMD - सबैभन्दा पुरानो मोड्युल प्रणाली मध्ये एक हो। सुरुमा यो[require.js] (https://reqirirejs.org/) प्रयोग गरियो।

CommonJS - module system created for Node.js server.

CommonJS - मोड्युल प्रणाली नोड ट्रान्स सर्भर को लागी सिर्जना गरिएको हो।।

UMD - module system that is compatible with AMD and CommonJS.

UMD - मोड्युल प्रणाली जुन AMD र CommonJS सँग उपयुक्त छ।


Modules can load each other, and use special directives import and export to interchange functionality, and call functions of each other.
मोड्युलहरूले एक अर्कालाई लोड गर्न सक्दछन्, र कार्यक्षमता आदानप्रदान गर्न विशेष निर्देशनहरू आयात र निर्यात प्रयोग गर्न सक्दछन्, र एक अर्काको कार्यहरू कल गर्न सक्दछन्।

export - labels functions and variables that should be accessible  from outside  the current module

निर्यात ले लेबलहरू कार्यहरू र चरहरू जुन हालको मोड्युल बाहिरबाट पहुँच योग्य हुनुपर्दछ।

import - imports functionality from outside module

आयात - बाहिर मोड्युलबाट कार्यक्षमता आयात गर्दछ।


Let's see the import  , and export mechanism in modules.  We have  sayHi function exported from sayHi.js file.
मोड्युलमा 'आयात' र 'निर्यात' संयन्त्र हेरौं।  हामीसँग sayHi प्रकार्य sayHi.js फाइलबाट निर्यात गरिएको छ।
// 📁 sayHi.js
export const sayHi = (user) => {
  alert(`Hello, ${user}!`);
}

The sayHi function is consumed in the main.js file with the help of the import directive.
'आयात' निर्देशनको सहायताले main.js फाइलमा sayHi प्रकार्य खपत हुन्छ।
// 📁 main.js
import {sayHi} from './sayHi.js';

alert(sayHi); // function...
sayHi('Kelvin'); // Hello, Kelvin!

  Here, the import directive loads the module by importing the relative path and assigns the sayHi variable.
यहाँ, आयात निर्देशिकाले सापेक्ष पथ आयात गरेर मोड्युल लोड गर्दछ र sayHi चर प्रदान गर्दछ।
Modules can be exported in two ways: Named and Default. Furthermore, the Named exports can be assigned inline or individually.
मोड्युलहरू दुई तरिकामा निर्यात गर्न सकिन्छ: नाम र पूर्वनिर्धारित । यसबाहेक, नामित निर्यातहरू इनलाइन वा व्यक्तिगत रूपमा तोक्न सकिन्छ।
// 📁 person.js 

// inlined named exports
export const name = "Kelvin";
export const age = 30;

// at once
const name = "Kelvin";
const age = 30;
export {name, age};

One can only have one default export in a file.
एउटा फाइलमा एउटा मात्र पूर्वनिर्धारित 'निर्यात' हुन सक्छ ।

// 📁 message.js
const message = (name, age) => {
    return `${name} is ${age} years old.`;
};
export default message;


Based on the type of export, we can import it in two ways. The named export are constructed using curly braces whereas, default exports are not.
निर्यातको प्रकारका आधारमा हामी यसलाई दुई तरिकाले आयात गर्न सक्छौं। नामित निर्यात घुंघराले ब्रेसेस प्रयोग गरेर निर्माण गरिएको छ जबकि, पूर्वनिर्धारित निर्यात हरू छैनन्।
import { name, age } from "./person.js"; // named export import
import message from "./message.js"; // default export import

While assigning modules, we should avoid circular dependency. Circular dependency is a situation where module A depends on B, and B  also depends on A directly or indirectly.
मोड्युलहरू निर्दिष्ट गर्दा, हामीले circular dependency बच्नुपर्छ। सर्कुलर निर्भरता एक स्थिति हो जहाँ मोड्युल ए बी मा निर्भर गर्दछ, र बी पनि प्रत्यक्ष वा अप्रत्यक्ष रूपमा ए मा निर्भर गर्दछ।

classes/.body:
Classes
वर्ग
Classes are templates for creating an object. It encapsulates data with code to work on with data. The keyword class is used to create a class.  And a specific method called constructor is used for creating and initializing an object created with a class. An example of car class is shown below.
वर्गहरू (classes) वस्तु सिर्जना गर्न टेम्प्लेटहरू हुन्। यसले डेटाको साथ काम गर्न कोडको साथ डेटा लाई समाहित गर्दछ। कुञ्जीशब्द 'वर्ग' वर्ग सिर्जना गर्न प्रयोग गरिन्छ।  र 'कन्स्ट्रक्टर' नामक एक विशिष्ट विधि 'वर्ग' को साथ सिर्जना गरिएको वस्तु सिर्जना गर्न र सुरु गर्न प्रयोग गरिन्छ। कार वर्गको एक उदाहरण तल देखाइएको छ।
class Car {
  constructor(name, year) {
    this.name = name;
    this.year = year;
  }
  age() {
    let date = new Date();
    return date.getFullYear() - this.year;
  }
}

let myCar = new Car("Toyota", 2021);
console.log(myCar.age()) // 1

Class must be defined before its usage.
वर्ग यसको प्रयोग गर्नु अघि परिभाषित गर्नु पर्दछ।

In the class body, methods or constructors are defined and executed in strict mode. Syntax not adhering to the strict mode results in error. 
वर्ग शरीरमा, विधिहरू वा कन्स्ट्रक्टरहरू परिभाषित गरिन्छ र strict mode मा कार्यान्वयन गरिन्छ। वाक्यविन्यासले कडा मोडको पालना नगर्दा त्रुटि हुन्छ ।

classes/static.html.body:
Static
स्थिर
The static keyword defines the static methods or properties for a class.  These methods and properties are called in the class itself. 
'स्थिर' कीवर्डले वर्गको लागि स्थिर विधिहरू वा गुणहरू परिभाषित गर्दछ।  यी विधिहरू र गुणहरू वर्गमा नै भनिन्छ।
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
}
let myCar = new Car("Toyota");

console.log(myCar.hello()); // This will throw an error
console.log(Car.hello(myCar));
// Result: Hello Toyota

One can access the static method or property of another static method of the same class using this keyword.   
this कीवर्ड प्रयोग गरेर उही वर्गको अर्को स्थिर विधिको स्थिर विधि वा गुण पहुँच गर्न सक्छ।

classes/inheritance.html.body:
Inheritance
उत्तराधिकार
The inheritance is useful for code reusability purposes as it extends existing properties and methods of a class. The extends keyword is used to create a class inheritance.  
उत्तराधिकार कोड पुन: प्रयोज्य उद्देश्यहरूको लागि उपयोगी छ किनकि यसले एक वर्गको अवस्थित गुणहरू र विधिहरू विस्तार गर्दछ। वर्ग वंशानुक्रम सिर्जना गर्न extends कीवर्ड प्रयोग गरिन्छ।
class Car {
  constructor(brand) {
    this.carname = brand;
  }
  present() {
    return 'I have a ' + this.carname;
  }
}

class Model extends Car {
  constructor(brand, mod) {
    super(brand);
    this.model = mod;
  }
  show() {
    return this.present() + ', it is a ' + this.model;
  }
}

let myCar = new Model("Toyota", "Camry");
console.log(myCar.show()); // I have a Camry, it is a Toyota.

The prototype of the parent class must be an Object or null. 
अभिभावक वर्गको प्रोटोटाइप 'वस्तु' वा 'शून्य' हुनुपर्दछ।

The super method is used inside a constructor and refers to the parent class. With this, one can access the parent class properties and methods.
'सुपर' विधि कन्स्ट्रक्टर भित्र प्रयोग गरिन्छ र मूल वर्गलाई बुझाउँछ। यसको साथ, एक अभिभावक वर्ग गुणहरू र विधिहरू पहुँच गर्न सक्दछ।

promise-async-await/async-await.html.body:
Async/Await
असिंक/प्रतिक्षा
With promises, one can use a async keyword to declare an asynchronous function that returns a promise whereas the await  syntax makes JavaScript wait until that promise settles and returns its value. These keywords make promises easier to write.  An example of async is shown below.
प्रतिज्ञाहरूको साथ, एक एसिंक कीवर्ड प्रयोग गर्न सक्दछ एक एसिंक्रोनस प्रकार्य घोषणा गर्न जसले प्रतिज्ञा फर्काउँछ जबकि प्रतीक्षा वाक्यरचनाले जाभास्क्रिप्टलाई प्रतीक्षा गर्दछ जबसम्म त्यो प्रतिज्ञा व्यवस्थित हुँदैन र यसको मान फर्काउँछ। यी कुञ्जीशब्दहरूले प्रतिज्ञाहरू लेख्न सजिलो बनाउँदछ।  एसिंकको एक उदाहरण तल देखाइएको छ।
//async function f
async function f() {
  return 1;
}
// promise being resolved
f().then(alert); // 1

The above example can be written as follows:
माथिको उदाहरण निम्नको रूपमा लेख्न सकिन्छ:
function f() {
  return Promise.resolve(1);
}

f().then(alert); // 1

async ensures that the function returns a promise, and wraps non-promises in it. With await, we can make JavaScript wait until the promise is settled with its value returned. 
एसिंक ले यो सुनिश्चित गर्दछ कि प्रकार्यले एक प्रतिज्ञा फर्काउँछ, र यसमा गैर-प्रतिज्ञाहरू लपेट्दछ। प्रतीक्षा को साथ, हामी जाभास्क्रिप्टलाई प्रतिक्षा गर्न सक्दछौं जबसम्म प्रतिज्ञा यसको मूल्य फिर्ता को साथ व्यवस्थित हुँदैन।
async function f() {
  let promise = new Promise((resolve, reject) => {
    setTimeout(() => resolve("Welcome to Learn JavaScript!"), 1000)
  });

  let result = await promise; // wait until the promise resolves (*)
  alert(result); // "Welcome to Learn JavaScript!"
}

f();

The await keyword can only be used inside an async function.
प्रतिक्षा कुञ्जीशब्द केवल एसिंक प्रकार्य भित्र प्रयोग गर्न सकिन्छ।

