functions/.body:
Functions
प्रकार्यहरू
Functions are one of the most powerful and essential notions in programming. Functions like mathematical functions perform transformations, they take input values called arguments and return an output value.  
प्रकार्यहरू प्रोग्रामिंगमा सबैभन्दा शक्तिशाली र आवश्यक धारणाहरू मध्ये एक हो। गणितीय प्रकार्यहरू जस्ता प्रकार्यहरूले रूपान्तरणहरू प्रदर्शन गर्दछ, उनीहरूले इनपुट मानहरू लिन्छन् जसलाई तर्क र रिटर्न आउटपुट मान भनिन्छ।
Functions can be created in two ways: using function declaration or function expression . The function name can be omitted in function expression making it an anonymous function.  Functions, like variables, must be declared. Let's declare a function double that accepts an argument called x and returns the double of x :
प्रकार्यहरू दुई तरिकामा सिर्जना गर्न सकिन्छ: प्रकार्य घोषणा वा प्रकार्य अभिव्यक्त प्रयोग गरेर। function name एफ 'अनकसन अभिव्यक्ति' मा छोड्न सकिन्छ जसले यसलाई 'अज्ञात प्रकार्य' बनाउँदछ।  प्रकार्यहरू, चरहरू जस्तै, घोषणा गर्नुपर्दछ। आउनुहोस् एउटा प्रकार्यलाई 'डबल' घोषणा गरौं जसले x भनिने तर्क स्वीकार गर्दछ र एक्सको डबल फर्काउँछ:
// an example of a function declaration
function double(x) {
  return 2 * x;
}


Note: the function above may be referenced before it has been defined.
नोट: माथिको प्रकार्य * परिभाषित हुनुभन्दा पहिले  सन्दर्भित हुन सक्छ।

Functions are also values in JavaScript; they can be stored in variables (just like numbers, strings, etc ...) and given to other functions as arguments :
प्रकार्यहरू जाभास्क्रिप्टमा पनि मानहरू हुन्; तिनीहरू चरमा भण्डारण गर्न सकिन्छ (जस्तै संख्याहरू, स्ट्रिङहरू, आदि ...) र तर्कको रूपमा अन्य प्रकार्यहरूमा दिइन्छ:
// an example of a function expression
let double = function (x) {
  return 2 * x;
};


Note: the function above may not be referenced before it is defined, just like any other variable.
नोट: माथिको प्रकार्य * लाई परिभाषित गर्नु अघि  सन्दर्भित नहुन सक्छ, कुनै पनि अन्य चर जस्तै।

 A callback is a function passed as an argument to another function.
कलब्याक एक प्रकार्य हो जुन अर्को प्रकार्यको तर्कको रूपमा पारित गरिएको छ।

An arrow function is a compact alternative to traditional functions which has some semantic differences with some limitations. These function doesn't have their own bindings to this, arguments and super, and cannot be used as constructors. An example of an arrow function.
एक एरो प्रकार्य पारंपरिक प्रकार्यहरूको लागि एक कम्प्याक्ट विकल्प हो जुन केहि सीमाहरूको साथ केहि अर्थपूर्ण भिन्नताहरू छन्। यी प्रकार्यहरूको this, arguments र super सँग उनीहरूको आफ्नै बाध्यकारी छैन, र कन्स्ट्रक्टरको रूपमा प्रयोग गर्न सकिँदैन। एरो प्रकार्यको एक उदाहरण।
const double =  (x) =>  2 * x;

The this keyword in the arrow function represents the object that defined the arrow function. 
एरो प्रकार्यमा this कुञ्जीशब्दले तीर प्रकार्य परिभाषित गर्ने वस्तुलाई प्रतिनिधित्व गर्दछ ।

error-handling/try...-catch.html.body:
try... catch
प्रयास ... क्याच गर्नुहोस्
In programming errors happen for various reasons, some happen from code errors,  some due to wrong input, and other unforeseeable things.  When an error happens, the code stops and generates an error message usually seen in the console. 
प्रोग्रामिंग त्रुटिहरूमा विभिन्न कारणहरूको लागि हुन्छ, केहि कोड त्रुटिहरूबाट हुन्छन्, केहि गलत इनपुटको कारण, र अन्य अप्रत्याशित चीजहरूको कारण।  जब एउटा त्रुटि हुन्छ, कोड रोकिन्छ र सामान्यतया कन्सोलमा देखिने त्रुटि सन्देश उत्पन्न गर्दछ ।
Instead of halting the code execution, we can use the try...catch construct that allows catching errors without dying the script. The try...catch construct has two main blocks; try and then catch. 
कोड कार्यान्वयन रोक्नुको सट्टा, हामी प्रयास गर्नुहोस् ... क्याच निर्माण जसले स्क्रिप्टको मृत्यु बिना त्रुटिहरू समात्न अनुमति दिन्छ। 'कोशिश... क्याच 'कन्स्ट्रक्टमा दुई मुख्य ब्लकहरू छन्; 'कोशिश' और फिर 'कैच'।
try {
  // code...
} catch (err) {
  // error handling
}

  At first, the code in the try block is executed. If no errors are encountered then it skips the catch block. If an error occurs then the try execution is stopped, moving the control sequence to the catch block. The cause of the error is captured in err variable.
सुरुमा, प्रयास ब्लकमा कोड कार्यान्वयन गरिन्छ। यदि कुनै त्रुटिहरू देखा परेनन् भने यसले क्याच ब्लक छोड्छ। यदि कुनै त्रुटि उत्पन्न हुन्छ भने प्रयास कार्यान्वयन रोकिन्छ, नियन्त्रण अनुक्रमलाई क्याच ब्लकमा सार्दछ। त्रुटिको कारण त्रुटि चरमा कब्जा गरिएको छ।
try {
  // code...
  alert('Welcome to Learn JavaScript');  
  asdk; // error asdk variable is not defined
} catch (err) {
  console.log("Error has occurred");
}

try...catch works for runtime errors meaning that the code must be runnable and synchronous.
प्रयास ... क्याच रनटाइम त्रुटिहरूको लागि काम गर्दछ जसको अर्थ कोड रनेबल र सिंक्रोनस हुनुपर्दछ।

To throw a custom error, a throw statement can be used. The error object, that gets generated by errors has two main properties. 
अनुकूल त्रुटि फ्याँक्न, 'थ्रो' कथन प्रयोग गर्न सकिन्छ। त्रुटि वस्तु, जुन त्रुटिहरू द्वारा उत्पन्न हुन्छ, दुई मुख्य गुणहरू छन्।

name:  error name
message: details about the error

नाम: त्रुटि नाम

सन्देश: त्रुटिको बारेमा विवरण

If we don't need an error message catch can omit it.
यदि हामीलाई 'त्रुटि' सन्देश आवश्यक छैन भने क्याचले यसलाई छोड्न सक्छ।

promise-async-await/promise.html.body:
Promise, async/await
प्रतिज्ञा, असिंक/प्रतीक्षा
Imagine you are a popular book writer, and you are planning to release a new book on a certain day. Readers who have an interest in this book are adding this book to their wishlist and are notified when published or even if the release day got postponed too. On the release day, everyone gets notified and can buy the book making all parties happy. This is a real-life analogy that happens in programming.
कल्पना गर्नुहोस् कि तपाईं एक लोकप्रिय पुस्तक लेखक हुनुहुन्छ, र तपाईं एक निश्चित दिनमा नयाँ पुस्तक जारी गर्ने योजना बनाउँदै हुनुहुन्छ। यस पुस्तकमा रुचि राख्ने पाठकहरूले यस पुस्तकलाई आफ्नो इच्छासूचीमा थपिरहेका छन् र प्रकाशित हुँदा वा प्रकाशन को दिन पनि स्थगित भएको अवस्थामा सूचित गरिन्छ। रिलीजको दिन, सबैलाई सूचित गरिन्छ र सबै पक्षलाई खुसी पार्ने पुस्तक किन्न सकिन्छ। यो एक वास्तविक जीवन सादृश्य हो जुन प्रोग्रामिंगमा हुन्छ।

A "producing code" is something that takes time and accomplishes something. Here it's a book writer.
"producing code" भनेको समय लाग्ने र कुनै कुरा पूरा गर्ने कुरा हो। यहाँ यो एक पुस्तक लेखक हो।

A "consuming code" is someone who consumes the "producing code" once it's ready. In this case, it's a "reader".
"consuming code" ले "उत्पादन कोड" एक पटक तयार भएपछि उपभोग गर्दछ। यस मामला मा, यो एक "पाठक" हो।

The linkage between the "producing code" and the "consuming code" can be called a promise as it assures getting the results from the "producing code" to the "consuming code".


"producing code" र "consuming code" बीचको सम्बन्धलाई प्रतिज्ञा भन्न सकिन्छ किनकि यसले "producing code" बाट "consuming code" मा परिणामहरू प्राप्त गर्ने आश्वासन दिन्छ।
The analogy that we made is also true for the JavaScript promise object. The constructor syntax for the promise object is:
हामीले बनाएको सादृश्य जाभास्क्रिप्ट 'प्रतिज्ञा' वस्तुको लागि पनि सत्य छ। 'प्रतिज्ञा' वस्तुका लागि कन्स्ट्रक्टर वाक्यविन्यास हो।
let promise = new Promise(function(resolve, reject) {
  // executor (the producing code, "writer")
});

Here, a function is passed to new Promise also known as the executor, and runs automatically upon creation. It contains the producing code that gives the result. resolve and rejects are the arguments provided by the JavaScript itself and are called one of these upon results.
यहाँ, एउटा प्रकार्य 'नयाँ प्रतिज्ञा' मा पास गरिएको छ जसलाई निष्पादक पनि भनिन्छ, र सिर्जनामा स्वचालित रूपमा चल्छ। यसले उत्पादन कोड समावेश गर्दछ जुन परिणाम दिन्छ। 'रिजोल्भ' र 'रिजेक्ट' जाभास्क्रिप्टद्वारा नै प्रदान गरिएका तर्कहरू हुन् र परिणामहरूमा यीमध्ये एक भनिन्छ।

resolve(value): a callback function that returns value upon result
(एक कलब्याक प्रकार्य जसले परिणाममा 'मान' फर्काउँछ)

reject(error): a callback function that returns error upon error, it returns an error object (कलब्याक प्रकार्य जसले त्रुटिमा 'त्रुटि' फर्काउँछ, यसले त्रुटि वस्तु फर्काउँछ)


The internal properties of promise object returned by the new Promise constructor are as follows:
'नयाँ प्रतिज्ञा' कन्स्ट्रक्टरद्वारा फिर्ता गरिएको 'प्रतिज्ञा' वस्तुको आन्तरिक गुणहरू निम्नानुसार छन्:

state - initially pending, then changes to either fulfill upon resolve or rejected when reject is called (सुरुमा 'पेन्डिङ', त्यसपछि समाधानमा 'पूरा' वा 'अस्वीकार' गर्दा 'अस्वीकृत' मा परिवर्तन हुन्छ)

result - initially undefined, then changes to value upon resolve or error when reject is called (सुरुमा 'अपरिभाषित', त्यसपछि 'रिजेक्ट' गर्दा 'रिजोल्युसन' वा 'त्रुटि' मा 'मान' मा परिवर्तन हुन्छ जब 'अस्वीकार' भनिन्छ)


Promise with resolve and reject callbacks


एक प्रतिज्ञा गुणहरू पहुँच गर्न सक्दैन: स्टेट र परिणाम। प्रतिज्ञाहरू सम्हाल्न प्रतिज्ञा विधिहरू आवश्यक छन्।

Example of a promise.
प्रतिज्ञा को उदाहरण।
let promiseOne = new Promise(function(resolve, reject) {
  // the function is executed automatically when the promise is constructed

  // after 1-second signal that the job is done with the result "done"
  setTimeout(() => resolve("done"), 1000);
})

let promiseTwo = new Promise(function(resolve, reject) {
  // the function is executed automatically when the promise is constructed

  // after 1-second signal that the job is done with the result "error"
  setTimeout(() => reject(new Error("Whoops!")), 1000);
})

Here, the promiseOne is an example of a "fulfilled promise" as it successfully resolves the values, whereas the promiseTwo is a "rejected promise" as it gets rejected. A promise that is either rejected or resolved is called a settled promise, as opposed to an initially pending promise. Consuming function from the promise can be registered using the .then and .catch methods. We can also add .finally method for performing cleanup or finalizing after previous methods have been completed.
यहाँ, promiseOne एक "fulfilled promise" को एक उदाहरण हो किनकि यसले सफलतापूर्वक मानहरू समाधान गर्दछ, जबकि promiseTwo एक "rejected promise" हो किनकि यो अस्वीकार हुन्छ। अस्वीकृत वा समाधान गरिएको प्रतिज्ञालाई सुरुमा पेन्डिङ गरिएको प्रतिज्ञाको विपरीत सेटल प्रतिज्ञा भनिन्छ। प्रतिज्ञाबाट प्रकार्य उपभोग गर्दा .then र .catch विधिहरू प्रयोग गरेर दर्ता गर्न सकिन्छ। हामी पहिलेका विधिहरू पूरा भएपछि सफाई वा अन्तिम रूप दिनका लागि .finally विधि पनि थप्न सक्छौं।
let promiseOne = new Promise(function(resolve, reject) {
  setTimeout(() => resolve("done!"), 1000);
});

// resolve runs the first function in .then
promiseOne.then(
  result => alert(result), // shows "done!" after 1 second
  error => alert(error) // doesn't run
);

let promiseTwo = new Promise(function(resolve, reject) {
  setTimeout(() => reject(new Error("Whoops!")), 1000);
});

// reject runs the second function in .then
promiseTwo.then(
  result => alert(result), // doesn't run
  error => alert(error) // shows "Error: Whoops!" after 1 second
);

let promiseThree = new Promise((resolve, reject) => {
  setTimeout(() => reject(new Error("Whoops!")), 1000);
});

// .catch(f) is the same as promise.then(null, f)
promiseThree.catch(alert); // shows "Error: Whoops!" after 1 second

In the Promise.then() method, both callback arguments are optional.
Promise.then() विधिमा, दुबै कलब्याक तर्कहरू वैकल्पिक छन्।

